INSERT INTO `blogs` (`id`, `title`, `slug`, `details`, `image`, `show`, `meta_title`, `meta_description`, `click`, `created_at`, `updated_at`) VALUES
(3, 'Top trending fashion you need to know', 'inspired-by-an-icon-the-gerald-charles-maestro-original-time', '<p>For many of us, the name Gerald Charles is as unfamiliar as it is ordinary. But in the world of horology, the Gerald Charles name has held a status tantamount to that of a legend. Gerald Charles is the brand formed by the legendary Gerald Charles Genta in 2000. Gerald Genta, as many of you know, is the brainchild behind iconic watches like the Audemars Piguet Royal Oak and the Patek Philippe Nautilus.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Following his death in 2011, Gerald Charles continued to produce timepieces in limited quantities for its clients until Gerald Genta&#39;s former business partner revived the eponymous brand with the Maestro, a wholesome timepiece completely evocative of its name, characterised by the revival of Genta&#39;s artistically creative mindset and approach to watchmaking, thus propelling Gerald Charles once again back into the public limelight.</p>\r\n\r\n<p>&nbsp;</p>', '921608721768.jpg', 1, 'Watch', 'Top trending fashion you need to know', 27, '2020-12-11 09:53:42', '2020-12-23 01:09:34'),
(4, 'Tech Gadgets you should have', 'tech', '<p>rcytuvbiynoiu0u8yliguyfjtycuvghibjno</p>', '981608722741.jpg', 1, 'rdxtfcygvuhbjn', 'scafadghjm,m,.', 0, '2020-12-23 09:25:54', '2020-12-23 01:25:44'),
(5, 'Decorate Your HOME', 'macbook', '<p>txfcgvhbjkbhvghc</p>', '151608716377.jpg', 1, 'dryytfyghiohughjg', 'setrytfuygiuhgyjfhfg', 0, '2020-12-22 23:39:51', '2020-12-22 23:39:51');
