(263, 'Fitbit Versa 2 Health and Fitness Smartwatch', 5, 22, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>Use amazon Alexa built in to get quick news and information, check the weather, set timers and alarms, control your smart home devices and more all through the sound of your voice (third party app may be required; amazon Alexa not available in all countries)<br />\r\nBased on your heart rate, time asleep and restlessness, sleep score helps you better understand your sleep quality each night; also track your time in light, deep and REM sleep stages and get personal insights</p>\r\n\r\n<p>Control your Spotify app, download Pandora stations and add Deezer playlists, plus store and play 300+ songs on your wrist (subscription required; Pandora is us only)&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2)_1607694017.jpg\" style=\"height:455px; width:1110px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>With a larger display and an always on option, your information&rsquo;s always a quick glance away (always on display requires more frequent charging)<br />\r\nTrack heart rate 24/ 7, steps, distance, calories burned, hourly activity, active minutes and floors climbed. Syncing range - up to 6.1 meters<br />\r\nWorks around the clock with 6 plus day battery life (varies with use and other factors)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2 (2)_1607694050.jpg\" style=\"height:455px; width:1110px\" /></p>\r\n\r\n<p><br />\r\nGet a call, text, calendar and smartphone app notifications when your phone is nearby; plus send quick replies and a voice replies on android only.Works with Bluetooth headphones &amp; 200+ leading iOS and Android devices.</p>\r\n\r\n<p>Product Dimensions : 1.56 x 1.59 x 0.47 inches; 0.16 Ounces<br />\r\nItem model number : FB507BKBK<br />\r\nBatteries : 1 Lithium Polymer batteries required. (included)</p>', NULL, 'fitbit-versa-2-health-and-fitness-smartwatch', '1606638095.jpeg', '129.00', 'fixed', NULL, NULL, NULL, 'percent', '129.00', NULL, NULL, NULL, 1, 5, 1, 12, 1, 0, 1, 0, 0, NULL, '2020-11-29 08:25:11', '2020-12-23 02:20:16'),
(264, 'AmazonBasics Wireless Trackball Mouse', 1, 13, 14, '<p><strong>About this item</strong></p>\r\n\r\n<p>Wireless trackball mouse for desktop or laptop computers<br />\r\n2.4 ghz (non-bluetooth) wireless connection provides quick response with no lag<br />\r\nSmooth-rolling trackball feature gives you expert control and alleviates hand and wrist strain<br />\r\nIncludes top scrolling dial, programmable buttons, and right and left-click mouse buttons<br />\r\nWireless range of up to 30 feet; great for group gaming, presentations, and more<br />\r\nCompatible with Windows 7, 8, 10, Mac OS 10.11, 10.12, 10.13 and above. Note that the provided connector is USB-&nbsp;&nbsp; A, if your device only supports USB-C an additional adapter will be required.</p>\r\n\r\n<p><br />\r\nBrand &nbsp;&nbsp; &nbsp;AmazonBasics<br />\r\nmodel number &nbsp;&nbsp; &nbsp;G5W<br />\r\nPlatform &nbsp;&nbsp; &nbsp;Laptop, PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Mac os<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;4.2 ounces<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;5.31 x 3.94 x 1.85 inches<br />\r\nItem Dimensions LxWxH &nbsp;&nbsp; &nbsp;5.31 x 3.94 x 1.85 inches<br />\r\nColor &nbsp;&nbsp; &nbsp;Black<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;AmazonBasics<br />\r\nASIN &nbsp;&nbsp; &nbsp;B07G28NF3L<br />\r\nDate First Available &nbsp;&nbsp; &nbsp;August 15, 2019</p>', 21, 'amazonbasics-wireless-trackball-mouse', '1606730954.jpg', '59.00', 'fixed', NULL, NULL, NULL, 'fixed', '59.00', NULL, NULL, NULL, 1, NULL, 1, 4, 1, 0, 1, 0, 0, NULL, '2020-11-30 10:09:26', '2020-12-22 05:51:04'),
(265, 'DIERYA Mechanical Gaming Keyboard', 1, 13, 15, '<p>CLASSIC 60% COMPACT DESIGN: This DK61 mechanical keyboard has a perfect size and it&#39;s good for Home and Office use, without Numpad, more practical for Gamers and Typist, give more space to your desktop</p>\r\n\r\n<p>Dierya DK61E DRIVER: Powerful software editing features, personalize functions as you like, customize advanced features and offline macros, our software can meet all your needs and realize your endless imagination</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/With box_1608024673.jpg\" style=\"height:544px; width:1090px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/Dierya (2)_1608024575.jpg\" style=\"height:674px; width:1090px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/Dierya keyboard ad (2)_1608024605.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>PBT DOUBLESHOT KEYCAPS: Wear resistance and hardness are much higher than ABS keycaps, and oil-proof, providing best typing and gaming experience. And you can be hot-swapped replaced by other optical switches you like</p>\r\n\r\n<p>WATERPROOF CIRCUIT BOARD: Our keyboard&#39;s circuit board has IPX4 Certified, In the process of playing games and work, you can enjoy food and drinks more freely, because you will be very easy to clean our keyboard (the interface not waterproof)</p>\r\n\r\n<p>HOT-SWAPPED FUNCTION: The DK61 keyboard adopts Hot-swapped Gateron Optical Switches, you can swap its switches without desoldering or without purchasing a new keyboard. (Only Optical Switch compatible</p>\r\n\r\n<p>&nbsp;</p>', NULL, 'dierya-dk61e-60-mechanical-gaming-keyboard', '681608024516.jpg', '47.00', 'fixed', NULL, NULL, NULL, 'percent', '47.00', NULL, NULL, NULL, 1, 50, 1, 4, 1, 0, 0, 0, 0, NULL, '2020-12-01 03:59:31', '2020-12-20 22:51:12'),
(266, 'MCSaite Wireless Numeric Keypad & Mouse Combo', 1, 13, 16, '<h3>MCSaite Wireless Numeric Keypad &amp; Mouse Combo - Use One Receiver Wireless Number Pad Keyboard and Mouse for Laptop Desktop MAC</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3><img alt=\"\" src=\"http://192.168.0.102/sell/images/Bannar_1608024969.jpg\" style=\"height:337px; width:1090px\" /></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;About this item</strong></p>\r\n\r\n<p>MCSaite 2 in 1 Wireless&nbsp;Numeric Keypad &amp; Mouse Combo Just use One USB Port.（The Wireless Receiver is on the back of the mouse.）<br />\r\nPlug &amp; Play - Comes with a tiny USB Nano receiver(stored within the back of the mouse) , just plug it into your PC and then can use Numeric Keypad and Mouse.Built-in mini receiver and dustproof.<br />\r\nComfortable Keys - Big, full size, soft concave 22 button to improve efficiency，Convenient and quick design, perfect match your work.<br />\r\nErgonomic Mice - Tilt Angle design gives you comfortable experience，1200 dpi optical sensor: Move your mouse with accuracy and speed.<br />\r\nCompatible with PC and desktop computers that have Windows XP / Vista / 7 / 8 / 10 operating systems.</p>\r\n\r\n<p>Package Dimensions&nbsp; &nbsp;8.31 x 4.02 x 1.89 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;6.4 ounces<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;M MC Saite<br />\r\nASIN &nbsp;&nbsp; &nbsp;B0716VR7R1</p>\r\n\r\n<p>Item Weight&nbsp; &nbsp;6.4 ounces</p>\r\n\r\n<p>Manufacturer&nbsp; &nbsp;M MC Saite</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 'mcsaite-wireless-numeric-keypad-mouse-combo', '1606796996.jpg', '87.00', 'discount', '79.00', '2020-12-01', '2020-12-17', 'percent', '87.00', NULL, NULL, NULL, 1, NULL, 1, 9, 1, 0, 0, 1, 0, NULL, '2020-12-01 04:32:24', '2020-12-20 23:26:10'),
