(276, 'Samsung Gear S2 Smartwatch - Dark Gray', 5, 22, NULL, '<p><br />\r\n<strong>About this item</strong><br />\r\nSend and receive texts, calendar notifications, news updates and more right on your wrist and Battery performance may vary depending on network conditions and configuration, and device usage<br />\r\nWith rotating bezel and unique circular interface, easily access your apps and notifications.OS Tizen based wearable platform.Processor speed Dual core 1GHz exynos 3250<br />\r\nWith a circular design and stainless steel construction, the Gear S2 matches your style<br />\r\nThousands of third party apps available<br />\r\nInterchangeable bands and hundreds of available watch faces; Please refer the User Manual before use; It doesn&#39;t have speakers, hence use Level U bluetooth headphones to hear music</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nWith elegant curves and premium finishes, the Samsung Gear S2 will turn heads. The circular interface and rotating bezel give you effortless navigation, so you can quickly access the things that are most important to you. This intuitive interface lets you easily access important notifications, texts, and updates from your phone with just a glance at your wrist. The built-in S-Health app tracks your steps, your heart rate, and even gives you a nudge when it&rsquo;s time to get moving. And with built-in wireless charging, it&rsquo;s easy to keep the Gear S2 powered up. Whether you&rsquo;re at home, work or anywhere in between, you can power up by simply setting your Gear S2 on the included wireless charging dock. Plus, with easily customizable watch faces, you can customize the Gear S2 to fit your unique style. With powerful capabilities and sleek looks, the Gear S2 will help you get the most out of your day.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;1.96 x 1.67 x 0.45 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;0.8 ounces<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)<br />\r\nIs Discontinued By Manufacturer&nbsp;&nbsp; &nbsp;No<br />\r\nOS&nbsp;&nbsp; &nbsp;Android<br />\r\nRAM&nbsp;&nbsp; &nbsp;512 MB<br />\r\nWireless communication technologies&nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi<br />\r\nConnectivity technologies&nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi<br />\r\nAdditional Features&nbsp;&nbsp; &nbsp;Waterproof<br />\r\nOther display features&nbsp;&nbsp; &nbsp;Wireless<br />\r\nDevice interface - primary&nbsp;&nbsp; &nbsp;Touchscreen<br />\r\nColour&nbsp;&nbsp; &nbsp;Dark Gray<br />\r\nDepartment&nbsp;&nbsp; &nbsp;Unisex</p>\r\n\r\n<ul>\r\n	<li>Supported Application&nbsp;&nbsp; &nbsp;Time Display, Email, Messages, Social Media, Calendar, Pedometer, Heart Rate Monitor</li>\r\n	<li>Brand&nbsp;&nbsp; &nbsp;Samsung Electronics</li>\r\n	<li>Supports Bluetooth&nbsp;&nbsp; &nbsp;Bluetooth</li>\r\n	<li>Color&nbsp;&nbsp; &nbsp;Dark Gray</li>\r\n	<li>Connectivity Technology&nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi</li>\r\n</ul>', 17, 'samsung-gear-s2-smartwatch-dark-gray', '131607598936.jpg', '269.00', 'fixed', NULL, NULL, NULL, 'fixed', '269.00', NULL, NULL, NULL, 1, NULL, 1, 2, 1, 1, 0, 0, 0, NULL, '2020-12-10 11:15:51', '2020-12-12 23:26:27'),
(277, 'Samsung Galaxy Watch Active 2', 5, 22, NULL, '<p><strong>&nbsp;About this item</strong></p>\r\n\r\n<p>Have your caddie with you: Get accurate distances to and from anywhere on the course so you can plan your game on over 40,000 courses worldwide. (Distance measured from watch to the center of the green; accuracy may be temporarily impacted by course redesigns)<br />\r\nGive your swing some style: Look like a pro and sport the lightweight, water-resistant design comfortably through all 18 holes. (Water-resistant up to 50 meters per ISO standard 22810:2010. Not intended for scuba diving. Avoid excessive, sudden temperature changes and high-velocity activities. Rinse in fresh water/dry after use in sea water or chlorinated water.)<br />\r\n&nbsp;&nbsp;<img alt=\"\" src=\"https://192.168.0.102/sell/images/64c1d221-5952-4cfb-b77b-155b41224293.__CR0,0,1464,600_PT0_SX1464_V1____1607599506.jpg\" style=\"height:459px; width:1120px\" /></p>\r\n\r\n<p>See what you need to see: The full-color super Amoled display makes it easy to see your screen, even in direct sunlight.<br />\r\nBetter insights to reach your fitness goals: Auto Tracking - Galaxy Watch Active2 Golf Edition automatically tracks your most popular activities, from cycling to swimming. You can also manually track additional exercises, so your watch is working harder for you . Pace Coach - Get more out of every mile thanks to built-in pace coaching on the Galaxy Watch Active2 Golf Edition. Its advanced sensors keep your pace to help you better achieve your run goals.<br />\r\nKeep your beat: You can see if your heart rate is where you want it with Galaxy Watch Active2 Golf Edition. This device and related software are not intended for use in the diagnosis of disease or other conditions, or in the cure, mitigation, treatment or prevention of disease. Compatible phone models: Iphone</p>\r\n\r\n<p><br />\r\nThe Samsung Galaxy Watch Active2 Golf Edition brings smart to your golf game. You can get up-to-date information on over 40,000 golf courses around the world so you can always know accurate yardage to plan your next shot. A sleek, sporty design is built for style and comfort everywhere from the golf course to the pool to a night out. Plus, seamless notifications and integration with your favorite apps means you can stay on top of everything without interrupting your round. Distance measured from Watch to the center of the green; accuracy may be temporarily impacted by course redesigns Water-resistant up to 50 meters per ISO standard 22810:2010. Not intended for scuba diving. Avoid excessive, sudden temperature changes and high-velocity activities. Rinse in fresh water/dry after use in sea water or chlorinated water.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Package Dimensions &nbsp;&nbsp; &nbsp;3.8 x 3.4 x 2.5 inches</li>\r\n	<li>Item Weight &nbsp;&nbsp; &nbsp;6.4 ounces</li>\r\n	<li>Batteries &nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)</li>\r\n	<li>Wireless communication technologies &nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi</li>\r\n	<li>Connectivity technologies &nbsp;&nbsp; &nbsp;Wireless, Bluetooth</li>\r\n	<li>GPS &nbsp;&nbsp; &nbsp;Yes</li>\r\n	<li>Other display features &nbsp;&nbsp; &nbsp;Wireless</li>\r\n	<li>Device interface - primary &nbsp;&nbsp; &nbsp;Touchscreen, Buttons</li>\r\n	<li>Colour &nbsp;&nbsp; &nbsp;Black</li>\r\n	<li>Included Components &nbsp;&nbsp; &nbsp;Watch, Straps, Charger</li>\r\n	<li>Department &nbsp;&nbsp; &nbsp;Men&#39;s</li>\r\n	<li>Manufacturer &nbsp;&nbsp; &nbsp;Samsung</li>\r\n</ul>', 17, 'samsung-galaxy-watch-active-2', '521607599242.jpg', '349.00', 'fixed', NULL, NULL, NULL, 'fixed', '349.00', NULL, NULL, NULL, 1, NULL, 1, 25, 1, 0, 0, 1, 0, NULL, '2020-12-10 11:21:28', '2020-12-22 08:02:12'),
