(284, 'Apple Watch Series 6 - Blue', 5, 22, NULL, '<p>GPS model lets you take calls and reply to texts from your wrist<br />\r\n<strong>Measure your blood oxygen with an all-new sensor and app</strong><br />\r\nCheck your heart rhythm with the ECG app<br />\r\nThe Always-On Retina display is 2.5x brighter outdoors when your wrist is down<br />\r\nS6 SiP is up to 20% faster than Series 5<br />\r\n5GHz Wi-Fi and U1 Ultra Wideband chip<br />\r\nTrack your daily activity on Apple Watch and see your trends in the Fitness app on iPhone</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"https://192.168.0.102/sell/images/Apple_Watch_S6_GPS_Product_Page_L__en-US_01._CB403766981_ (2)_1607604731.jpg\" style=\"height:628px; width:1110px\" /><img alt=\"\" src=\"https://192.168.0.102/sell/images/Apple_Watch_S6_GPS_Product_Page_L__en-US_02._CB403766981_ (2)_1607604751.jpg\" style=\"height:628px; width:1110px\" /><img alt=\"\" src=\"https://192.168.0.102/sell/images/Apple_Watch_S6_GPS_Product_Page_L__en-US_03._CB403766981_ (2)_1607604787.jpg\" style=\"height:628px; width:1110px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://192.168.43.55/sell/images/Apple_Watch_S6_GPS_Product_Page_L__en-US_04._CB403766981_ (2)_1607849591.jpg\" style=\"height:628px; width:1110px\" /></p>\r\n\r\n<blockquote>\r\n<p>Measure workouts like running, walking, cycling, yoga, swimming, and dance<br />\r\nSwimproof design<br />\r\nSync your favorite music, podcasts, and audiobooks</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Built-in GPS, GLONASS, Galileo, and QZSS, S6 with 64-bit dual-core processor, W3 Apple wireless chip, U1 Ultra Wideband chip, Barometric altimeter, Capacity 32GB, Blood oxygen sensor, Optical heart sensor, Electrical heart sensor, Improved accelerometer up to 32 g‑forces, Improved gyroscope, Ambient light sensor, LTPO OLED Always-On Retina display with Force Touch (1000 nits), Digital Crown with haptic feedback, Louder speaker, Ion-X strengthened glass, Sapphire crystal and ceramic back, Wi-Fi 802.11b/g/n 2.4GHz, Bluetooth 5.0, Built-in rechargeable lithium-ion battery, Up to 18 hours of battery life, Water resistant 50 meters, watchOS 5</p>\r\n\r\n<p><strong>Technical Details</strong><br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;11.65 x 2.99 x 1.42 inches; 1.08 Ounces<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;1.08 ounces<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Apple Computer<br />\r\nASIN &nbsp;&nbsp; &nbsp;B08J5XF5SR<br />\r\nItem model number &nbsp;&nbsp; &nbsp;Series 6 GPS<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)</p>', 4, 'apple-watch-series-6-blue', '751607606409.jpg', '419.00', 'discount', '2.00', '2020-12-08', '2020-12-22', 'percent', '419.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 1, 0, 0, 1, NULL, '2020-12-10 13:22:07', '2020-12-20 05:34:56'),
(285, 'Junboer Compatible with Galaxy Watch', 5, 22, NULL, '<p><strong>About this item</strong><br />\r\nsmart has never been so beautiful: movado connect 2. 0 smartwatch, powered with wear os by google, android/apple ios compatible<br />\r\nquality materials, iconic style: features a 42 mm stainless steel case with ceramic case back and round digital touchscreen dial featuring hundreds of customizable dial variations on a stainless steel interchangeable bracelet<br />\r\nsmart module: powered with wear os by google, displays phone calls, appointments, emails, apps, music, text and social media messages; equipped with google fit for activity tracking, google pay for quick payments from your wrist and google assistant; heart rate monitor; programmable pushers; smart crown; charging cable for smart module<br />\r\ngorilla glass crystal: a thin sheet of glass that is able to survive the real-world events that most commonly cause glass failure. this glass has improved damage resistance and toughness by helping to prevent the deep chips and scratches that cause glass to break</p>\r\n\r\n<p><br />\r\nSport type: Exercise &amp; Fitness</p>\r\n\r\n<p>&nbsp;</p>', NULL, 'junboer-compatible-with-galaxy-watch', '221607606695.jpg', '99.00', 'fixed', NULL, NULL, NULL, 'fixed', '99.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-10 13:25:16', '2020-12-20 05:34:12');
