(286, 'HUAWEI Watch GT 2 2019 Bluetooth SmartWatch', 5, 22, NULL, '<p>Supported Application&nbsp;&nbsp; &nbsp;Fitness Tracker, Sleep Monitor, Find My Phone, Email, Social Media, Phone, Alarm, Calendar, GPS, Heart Rate Monitor See more<br />\r\nBrand&nbsp;&nbsp; &nbsp;Huawei<br />\r\nSize&nbsp;&nbsp; &nbsp;46mm<br />\r\nSupports Bluetooth&nbsp;&nbsp; &nbsp;Bluetooth<br />\r\nColor&nbsp;&nbsp; &nbsp;Brown</p>\r\n\r\n<p><br />\r\n<strong>About this item</strong><br />\r\n1.39 Inch (46MM) AMOLED Display with 3D Glass Screen: Resolution: 454x454 HD. Bluetooth 5.1, 14 days for typical use battery. 5 ATM water-resistant.<br />\r\nHUAWEI Kirin A1 Self-developed Chip: This smart watch comes with HUAWEI&#39;s self-developed wearable chip Kirin A1, and intelligent power saving technology to provide up to 7 days of battery Life.<br />\r\nBluetooth Call, Stay in touch: Thanks for the Bluetooth calling function of HUAWEI WATCH GT 2, you can make or receive calls during sports or when your hands are busy. Always stay in touch with your family or friends.<br />\r\n15 Workout Modes and Full-time Fitness Trainer: Multiple professional training courses from entry to advanced level are preinstalled on the watch, providing users with professional and effective guidance. Built with two positioning systems (GPS, GLONASS) together to detect more satellites, and increase positioning accuracy.<br />\r\nFeatures of everyday life: Real-time Heart rate monitoring: HUAWEI TruSeen is now updated to version 3.5 to provide a more efficient and real-time accurate personal heart rate measurement. TruSleepTM 2.0 sleep tracking and TruRelax pressure monitoring. Supports notifications from SMS, Email, Calendar, and other social media applications. You can also use other features like Time, Alarm, Timer, Stopwatch, flashlight and Find My Phone.</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nColor:Brown&nbsp; |&nbsp; Size:46mm<br />\r\nModel: HUAWEI WATCH GT 2 (46 mm) comes with one brown strap, no extra black strap.<br />\r\nSystem Requirements: Android 4.4 or later, iOS 9.0 or later.<br />\r\nPlease note: These features are not supported on iOS devices: Watch face store, Music playback control, Cycle tracking, All-day stress monitoring.<br />\r\nSports Function: Passometer, Fitness Tracker, Chronograph, Heart rate tracker, Swimming Heart Rate Monitoring, Outdoor Run/Walk, Indoor Run/Walk, Elliptical and Rower.<br />\r\nSwimming Heart Rate Monitoring: Thanks for the 5ATM water resistant feature, HUAWEI WATCH GT 2 can monitor your heart rate while you are swimming as well as the SWOLF, distance, calories burned and speed.<br />\r\nOxygen Saturation Detection: HUAWEI WATCH GT 2 supports single-time Blood oxygen saturation (SpO2) level measuring, helping you detect the level of oxygen in the blood whenever and wherever you need.<br />\r\nPlaying music: The HUAWEI GT 2 WATCH can store up to 500 songs and easily match with your HUAWEI FreeBuds 3. you can enjoy music from your favorite list without the phone when running or jogging. (Music storage is about 2 GB. Music supports mp3 and LC-AAC formats.)<br />\r\nCycle Tracking: Quickly record information about your menstrual cycle with Huawei Health APP, including dates, flow levels, and results from ovulation predictor kits. It will alert you when your period is about to start, and estimate when your fertile window will begin.<br />\r\nAll Day Monitoring Activity: Follow your fitness progress all day long such as your step count, calories burned, the number of times you stand up, and average periods for high intensity activities.</p>\r\n\r\n<p>Charger Voltage and Current Requirements: 5V 0.5A / 1A / 1.5A / 2A<br />\r\nButton: Power button, function button<br />\r\nCharging Port: Magnetic charging thimble</p>\r\n\r\n<p>In The Box: HUAWEI Watch GT 2 x 1, Charging cradle x 1, Charging cable x 1, User Guide x 1, Safety Information x 1</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nColor:Brown&nbsp; |&nbsp; Size:46mm<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;1.81 x 1.81 x 0.42 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;12 ounces<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;HUAWEI</p>', 10, 'huawei-watch-gt-2-2019-bluetooth-smartwatch', '281607609308.jpg', '239.00', 'fixed', NULL, NULL, NULL, 'fixed', '239.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 1, 0, 0, 0, NULL, '2020-12-10 14:11:25', '2020-12-20 05:33:38'),
