wn&nbsp; |&nbsp; Size:46mm<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;1.81 x 1.81 x 0.42 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;12 ounces<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;HUAWEI</p>', 10, 'huawei-watch-gt-2-2019-bluetooth-smartwatch80', '731607679518.jpg', '239.00', 'discount', '225.00', '2020-12-15', '2020-12-18', 'fixed', '239.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-11 09:52:39', '2020-12-20 05:31:28'),
(289, 'Fitbit Versa 2 Health and Fitness Smartwatch', 5, 22, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>Use amazon Alexa built in to get quick news and information, check the weather, set timers and alarms, control your smart home devices and more all through the sound of your voice (third party app may be required; amazon Alexa not available in all countries)<br />\r\nBased on your heart rate, time asleep and restlessness, sleep score helps you better understand your sleep quality each night; also track your time in light, deep and REM sleep stages and get personal insights</p>\r\n\r\n<p>Control your Spotify app, download Pandora stations and add Deezer playlists, plus store and play 300+ songs on your wrist (subscription required; Pandora is us only)&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2)_1607694017.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>With a larger display and an always on option, your information&rsquo;s always a quick glance away (always on display requires more frequent charging)<br />\r\nTrack heart rate 24/ 7, steps, distance, calories burned, hourly activity, active minutes and floors climbed. Syncing range - up to 6.1 meters<br />\r\nWorks around the clock with 6 plus day battery life (varies with use and other factors)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2 (2)_1607694050.jpg\" /></p>\r\n\r\n<p><br />\r\nGet a call, text, calendar and smartphone app notifications when your phone is nearby; plus send quick replies and a voice replies on android only.Works with Bluetooth headphones &amp; 200+ leading iOS and Android devices.</p>\r\n\r\n<p>Product Dimensions : 1.56 x 1.59 x 0.47 inches; 0.16 Ounces<br />\r\nItem model number : FB507BKBK<br />\r\nBatteries : 1 Lithium Polymer batteries required. (included)&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 'fitbit-versa-2-health-and-fitness-smartwatch57', '541607692252.jpg', '135.00', 'fixed', NULL, NULL, NULL, 'fixed', '135.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-11 13:11:55', '2020-12-20 05:27:33'),
(295, 'Honor 9X Play Store (128GB, 6GB)', 3, 18, NULL, '<p>Display Size&nbsp;&nbsp; &nbsp;6.21 Inches<br />\r\nMemory Storage Capacity&nbsp;&nbsp; &nbsp;128 GB<br />\r\nColor&nbsp;&nbsp; &nbsp;Midnight Black<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;0.45 Kilograms</p>\r\n\r\n<p><br />\r\n<strong>About this item</strong><br />\r\n6.59 inches TFT LCD (LTPS), 1080 x 2340 pixels, 19.5:9 ratio (~391 ppi density), Hisilicon Kirin 710F Processor, OS: EMUI 9.0 (Based on Android 9)<br />\r\n128GB ROM, 6GB RAM, Expandable 512GB storage 4000mAh battery, NFC: Not Supported, Dual SIM (Nano-SIM, dual stand-by)<br />\r\nFront camera: 16MP FF, Rear camera: 48MP + 8MP + 2MP, Octa-core (4x2.2 GHz Cortex-A73 &amp; 4x1.7 GHz Cortex-A53)<br />\r\n2G bands GSM: 850 / 900 / 1800 / 1900, 3G bands UMTS: 850 / 900 / 1700 / 1900 / 2100, 4G LTE Bands: LTE 1(2100), 2(1900), 3(1800), 4(1700/2100), 5(850), 7(2600), 8(900), 28(700)<br />\r\nInternational Version - No Warranty in US. International Model Compatible with Most GSM Carriers like T-Mobile, AT&amp;T, MetroPCS, etc. Will NOT work with CDMA Carriers Such as Verizon, Sprint, Boost</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nColor:Midnight Black<br />\r\nXceptional DesignWe create a rear panel from scratch to capture all eyes. Let yourself be surprised by its bright X-shaped effect from any point of view. HONOR FullView 6.59 &quot; screenXtraordinary Full Vision Immerse yourself fully in the wonders of the new 6.59 &quot;HONOR FullView Display.Now all your content, movies, games and images will occupy the entire front of your HONOR 9X. 16MP Pop-up CameraThe new HONOR 9X hidden front camera offers a viewing experience without distractions. Say goodbye to the notch. When you activate the camera of your HONOR 9X, it will appear magically in just a second, automatically hiding when you&#39;re done. Powerful, intelligent, fluidThe powerful high-response Kirin 710F eight-core processor ensures that all your favorite games and applications run smoothly with great energy efficiency. Storage the size of a laptopNo weight Xtra HONOR 9X supports up to 512 GB of expandable storage so you can store and move photos, movies and files conveniently wherever you go.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nColor:Midnight Black<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;3.16 x 0.37 x 5.93 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;15.8 ounces<br />\r\nItem model number&nbsp;&nbsp; &nbsp;20 lite<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\nOther display features&nbsp;&nbsp; &nbsp;Wireless<br />\r\nColour&nbsp;&nbsp; &nbsp;Midnight Black<br />\r\nPhone Talk Time&nbsp;&nbsp; &nbsp;20 Hours<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Honor</p>', 10, 'honor-9x-play-store-128gb-6gb', '691607852515.jpg', '325.00', 'fixed', NULL, NULL, NULL, 'fixed', '325.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-12 23:50:39', '2020-12-13 00:11:43'),
(296, 'Huawei Nova 5T (128GB, 8GB)', 3, 18, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p><br />\r\n6.26 inches All-View Display, 16.7 million colours, FHD+ 2340 x 1080, LCD, 97% Screen to Body ratio, 3750 mAh battery<br />\r\nMemory: 6 GB RAM + 128 GB ROM, CPU: HUAWEI Kirin 980 Octa-core, GPU: Mali-G76 720 MHz, Card Slot: No, 3.5mm Jack: No, Radio: No<br />\r\nRear Camera: 48 MP (f/1.8, high resolution lens) + 16 MP (f/2.2, ultra wide angle lens) + 2 MP (f/2.4, bokeh lens) + 2 MP (f/2.4, macro lens), Front Camera: 32 MP (f/2.0, high resolution lens)<br />\r\n2G bands: GSM 850 / 900 / 1800 / 1900, 3G bands: HSDPA 800 / 850 / 900 / 1700(AWS) / 1900 / 2100, 4G bands: LTE band 1(2100), 2(1900), 3(1800), 4(1700/2100), 5(850), 7(2600), 8(900), 18(800), 19(800), 20(800), 26(850), 28(700), 38(2600), 40(2300), 41(2500)<br />\r\nInternational Version - No Warranty in US. International Model Compatible with Most GSM Carriers like T-Mobile, AT&amp;T, MetroPCS, etc. Will NOT work with CDMA Carriers Such as Verizon, Sprint, Boost</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\n<br />\r\nColour That Gets NoticedHUAWEI nova 5T&rsquo;s dazzling colours, amazing textures and reflective design create an immersive feeling of boundless space. The refined finish and unique texture accentuate the contrast of light and shadow for a surreal and fantastical multi-layered 3D effect on a flat surface. Pushing Beauty to The EdgeHUAWEI is pushing smartphone design to the limits with an even bigger screen-to-body ratio on the all-new HUAWEI nova 5T. By hiding the front camera beneath the screen, HUAWEI nova 5T&rsquo;s screen retains its full integrity, revolutionizing user experience. Pro-cameras for your pocketHUAWEI nova 5T&rsquo;s four, rear-mounted AI cameras capture stunning high-definition, ultra-wide-angle, macro and bokeh photography. The cameras also create next-level videos. Rich, clear images and videos from vast landscapes to breathtaking close-ups. Powerful photo/video algorithms help you get colourful, high-resolution images and videos anytime and anywhere. Effortless Power at Lightning SpeedThe lightning-fast Kirin 980 chip is the leading commercial 7nm SoC chip, an innovative leap in lag-free, fluid user experiences. The DUAL-NPU offer outstanding AI capability, increased performance and greater efficiencies, making HUAWEI nova 5T responsive, fun and exciting to use. Super ChargingSlow charging slows down your life. Especially during times of heavy use. But HUAWEI nova 5T&rsquo;s 3750 mAh2 battery features a 22.5 W HUAWEI SuperCharge system. Charge 50% battery life in just 30 minutes. Play to Win: GPU Turbo The new generation GPU Turbo dramatically improves CPU and GPU processor performances, leveraging the Kirin 980 chips for a revolutionized immersive gaming experience. Supporting some of the world&rsquo;s most popular games.</p>\r\n\r\n<p><strong>Product information</strong></p>\r\n\r\n<p><br />\r\nColor:Purple<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;6 x 4 x 4 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;7.1 ounces<br />\r\nASIN&nbsp;&nbsp; &nbsp;B07YLKB6CR<br />\r\nItem model number&nbsp;&nbsp; &nbsp;Huawei Nova 5T<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium Metal batteries required. (included)</p>', 10, 'huawei-nova-5t-128gb-8gb', '501607854741.jpg', '299.00', 'fixed', NULL, NULL, NULL, 'fixed', '299.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-13 00:23:18', '2020-12-13 00:23:18'),
(297, 'Huawei P30 Lite', 3, 18, NULL, '<p><strong>Product description</strong><br />\r\nBrighter, wider and closer. See the world from new perspectives. Discover the unseen surprises and turn them into your treasured memories. The HUAWEI P30 LITE is pushing the envelope of smartphone photography. Drawing inspiration from the miraculous sky, the HUAWEI P30 mirrors the transfixing colour of light and space. Witness the beauty of a rosy dawn, mid-day sky, the mysterious Aurora and darkness of night. The Leica Triple Camera System accommodates your photography to help see the world in its entirety which The Leica Triple Camera System accommodates your photography to help see the world in its entirety and gives you the freedom to capture the treasure and beauty of the world. The 6.1 inch OLED HUAWEI Dewdrop display is precisely designed to provide you a broader and better viewing experience with vibrant colours shining in every way. Hold the HUAWEI P30 LITE comfortably with one hand, while a more advanced in-screen fingerprint sensor swiftly unlocks it. Charging is no longer a hassle, but a painless task. Easily charge up your phone during breakfast or coffee break with the T&Uuml;V Safety Certified HUAWEI SuperCharge.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nColor:Midnight Black<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;2.6 x 1.65 x 0.59 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;5.6 ounces<br />\r\nASIN&nbsp;&nbsp; &nbsp;B07PXSNRYY<br />\r\nItem model number&nbsp;&nbsp; &nbsp;6901443293070<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Huawei</p>\r\n\r\n<p>Service Provider&nbsp;&nbsp; &nbsp;Gsm<br />\r\nBrand&nbsp;&nbsp; &nbsp;Huawei<br />\r\nDisplay Size&nbsp;&nbsp; &nbsp;6.3 Inches<br />\r\nOperating System&nbsp;&nbsp; &nbsp;Android<br />\r\nMemory Storage Capacity&nbsp;&nbsp; &nbsp;128 GB</p>\r\n\r\n<p><br />\r\n<strong>About this item</strong><br />\r\nGSM / 4G LTE Compatible<br />\r\nRear 24MP Wide-Angle Camera + Rear 8MP Ultra-Wide Camera + Front 32MP Selfie Camera<br />\r\nLatin America Variant/US Compatible LTE<br />\r\nInternal Memory: 128GB, 4GB RAM - microSD Up to 512 GB (uses SIM 2 slot)<br />\r\nAndroid 9.0 (Pie), Hisilicon Kirin 710, Octa-Core (Quad Core 2.2 GHz Cortex-A73 &amp; Quad Core 1.7 GHz Cortex-A53), Mali-G51 MP4</p>', 10, 'huawei-p30-lite-128gb-4gb-ram-615-display-ai-triple-camera-32mp-selfie-dual-sim-global-4g-lte-gsm-factory-unlocked-mar-lx3a-international', '471607863809.jpg', '499.00', 'discount', '450.00', '2020-12-12', '2021-02-17', 'fixed', '499.00', NULL, NULL, NULL, 1, NULL, 1, 1, 1, 0, 0, 0, 1, NULL, '2020-12-13 02:50:35', '2020-12-13 03:03:02'),
