(300, 'Huawei P40 Pro Plus 5G', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nFor USA Buyers : This Smartphone is compatible/will work with CERTAIN GSM Networks ONLY. For exact 2G GSM, 3G, 4G/LTE and 5G compatibility, please check with your network provider in advance prior to your purchase. This phone WILL NOT WORK with any CDMA Networks such as VERIZON, SPRINT, US CELLULAR and T-Mobile.<br />\r\nWarning : There is no Google Mobile Services (GMS). Currently it&rsquo;s not possible to download Google Apps on new Huawei devices. Therefore please make sure that you understand this correctly prior to making any purchase. Please perform your own full research to confirm &quot;If you are still happy to have the Huawei device&quot;, without any &quot;Google Mobile Services (GMS)&quot;<br />\r\n6.58 inches, OLED capacitive touchscreen, 16M colors, 1200 x 2640 pixels (~441 ppi density)<br />\r\n256GB Storage | 8GB RAM | Up to 256GB NM (Nano Memory) - uses shared SIM slot<br />\r\nAndroid 10.0 (AOSP + HMS); EMUI 10.1, HiSilicon Kirin 990 5G (7 nm+), Octa-core (2x2.86 GHz Cortex-A76 &amp; 2x2.36 GHz Cortex-A76 &amp; 4x1.95 GHz Cortex-A55), Mali-G76 MP16</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nSpeak for yourself with the Ultra Vision Leica Quad Camera by capturing photos and videos anytime and anywhere you want. Revolutionize your experience of speed and power with the cutting-edge Kirin 990 5G Chipset. The innovative design upgrades your visual entertainment and ergonomic comfort. Explore now and future with HUAWEI P40 Pro.</p>\r\n\r\n<p>For USA Buyers : This Smartphone is compatible/will work with CERTAIN GSM Networks ONLY. For exact 2G GSM, 3G and 4G/LTE compatibility, please check with your network provider in advance prior to your purchase. This phone WILL NOT WORK with any CDMA Networks such as VERIZON, SPRINT, US CELLULAR and T-Mobile.</p>\r\n\r\n<p>Network Compatibility : Nano-SIM Dual-SIM (Dual-Standby)<br />\r\nFrequencies : Compatible to use with Network SIM Cards that works on;</p>\r\n\r\n<p>Primary SIM Card / SIM Card 1<br />\r\n2G : GSM 850 / 900 / 1800 / 1900<br />\r\n3G : WCDMA 800(B6) / 800(B19) / 850(B5) / 900(B8) / 1700|2100(B4) / 1900(B2) / 2100(B1)<br />\r\n4G : LTE 700(B12) / 700(B17) / 700(B28) / 800(B18) / 800(B19) / 800(B20) / 850(B5) / 850(B26) / 900(B8) / 1500(B32) / 1700|2100(B4) / 1800(B3) / 1900(B2) / 2100(B1) / 2600(B7) / Band 6 / Band 9 : TD-LTE 1900(B39) / 2100(B34) / 2300(B40) / 2500(B41) / 2600(B38)<br />\r\n5G : NR n1 / n3 / n7 / n28 (TX: 703-733 MHz, RX: 758-788 MHz) / n38 / n41 / n77 / n78 / n79</p>\r\n\r\n<p>Secondary SIM Card / SIM Card 2<br />\r\n2G : GSM 850 / 900 / 1800 / 1900<br />\r\n3G : WCDMA 800(B6) / 800(B19) / 850(B5) / 900(B8) / 1700|2100(B4) / 1900(B2) / 2100(B1)<br />\r\n4G : LTE 700(B12) / 700(B17) / 700(B28) / 800(B18) / 800(B19) / 800(B20) / 850(B5) / 850(B26) / 900(B8) / 1700|2100(B4) / 1800(B3) / 1900(B2) / 2100(B1) / 2600(B7) / Band 6 / Band 9 : TD-LTE 1900(B39) / 2100(B34) / 2300(B40) / 2500(B41) / 2600(B38)</p>\r\n\r\n<p>Either card slot can be set to accommodate the primary or secondary SIM card.<br />\r\nNote : Functions available on the live network depend on the situations of carrier&#39;s network and related services deployment.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;0.35 x 7.37 x 2.86 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;7.4 ounces<br />\r\nItem model number&nbsp;&nbsp; &nbsp;ELS-NX9<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Huawei</p>', 10, 'huawei-p40-pro-plus-5g', '631607869820.jpg', '999.00', 'fixed', NULL, NULL, NULL, 'fixed', '999.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-13 04:37:44', '2020-12-23 00:34:32'),
(301, 'Motorola E unlocked', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nUnlocked for the freedom to choose your carrier. Compatible with AT&amp;T, Sprint, T-Mobile, and Verizon networks. Sim card not included. Customers may need to contact Sprint for activation on Sprint&acirc;&euro;&trade;s network.<br />\r\n13 MP dual camera system. Get creative and get your best results, whether shooting beautiful close-ups or swapping out backgrounds.<br />\r\n42-hour battery. Power through today and into tomorrow on just a single charge with a 3550 mAh battery.<br />\r\n6.2&quot; Max Vision display. Enjoy an ultra-wide screen that stretches from edge to edge, yet is compact enough for one-handed use.<br />\r\nUltra-responsive performance. Feel your phone respond instantly to every touch, tap, and swipe with a Qualcomm Snapdragon 632 octa-core processor.<br />\r\nConvenient fingerprint reader. Instantly unlock your phone with the discrete fingerprint reader on the back of the device.<br />\r\nAdvanced water protection. Never worry about accidental spills and splashes.<br />\r\nWi-Fi Hotspot Ready: Moto G Stylus offers Wi-fi hotspot connectivity in 2.4 GHz + 5 GHz for the best experience.<br />\r\nOperating System: Android 10<br />\r\nIn-box: Charger, USB Cable, Guides, SIM tool</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/b001989c-c87a-477e-ba42-d66e46b340b1.__CR0,0,970,300_PT0_SX970_V1___ (2)_1607920778.jpg\" style=\"height:343px; width:1110px\" /><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Product description</strong><br />\r\nmoto e gives you a fast-focusing 13 MP dual-camera system, so you can easily add beautiful bokeh effects to portraits. Plus, you get a long-lasting battery, so you can go 42 hours on a single charge. Enjoy an ultra-wide 6.2&quot; Max Vision display, octa-core processor speed, and the simplicity of unlocking using only your fingerprint. moto e. More camera. More power. More fun.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;6.29 x 3.02 x 0.34 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;6.5 ounces<br />\r\nASIN&nbsp;&nbsp; &nbsp;B086H3HH5V<br />\r\nItem model number&nbsp;&nbsp; &nbsp;XT2052-1<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\nOS&nbsp;&nbsp; &nbsp;Android 10.0<br />\r\nRAM&nbsp;&nbsp; &nbsp;2 GB<br />\r\nConnectivity technologies&nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi<br />\r\nGPS&nbsp;&nbsp; &nbsp;GPS, A-GPS, LTEPP, SUPL, GLONASS, Galileo<br />\r\nAdditional Features&nbsp;&nbsp; &nbsp;Touchscreen, Bluetooth Enabled, Expandable Memory, Octa Core Processor, Default_no_selection_value, Water Resistant, Video Calling, Text/Messaging, Dual Band, Camera, Fingerprint Sensor, Smartphone, Built-In GPS, Mobile Hotspot Capability<br />\r\nOther display features&nbsp;&nbsp; &nbsp;Wireless<br />\r\nDevice interface - primary&nbsp;&nbsp; &nbsp;Touchscreen<br />\r\nOther camera features&nbsp;&nbsp; &nbsp;13MP camera<br />\r\nAudio Jack&nbsp;&nbsp; &nbsp;3.5 mm<br />\r\nForm Factor&nbsp;&nbsp; &nbsp;Smartphone<br />\r\nColour&nbsp;&nbsp; &nbsp;Blue<br />\r\nBattery Power Rating&nbsp;&nbsp; &nbsp;3500<br />\r\nIncluded Components&nbsp;&nbsp; &nbsp;Phone, SIM Tool, Charger, Guides, USB Cable<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Motorola</p>', 20, 'motorola-e-unlocked', '871607920625.jpg', '279.00', 'discount', '255.00', '2020-12-13', '2020-12-31', 'fixed', '279.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-13 18:46:14', '2020-12-14 00:27:00'),
(303, 'Moto G Stylus  Unlocked', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nUnlocked for the freedom to choose your carrier. Compatible with AT&amp;T, Sprint, T-Mobile, and Verizon networks. Sim card not included. Customers may need to contact Sprint for activation on Sprint&rsquo;s network.<br />\r\n48 MP1 triple camera system. Capture outstanding shots in any situation, from sharp and bright low-light photos to ultra-wide angle action videos.<br />\r\nBuilt-in stylus. Edit photos with pinpoint precision, jot notes, sketch freely, and experience finer control with everyday tasks.<br />\r\nUp to two days battery life2. Go longer on a single charge with a 4000 mAh battery.<br />\r\nDual Stereo Speakers tuned by Dolby. Enjoy crystal-clear audio that&rsquo;s 4x more powerful2 with dual stereo speakers tuned by Dolby.<br />\r\nMax Vision display. Bring games and movies to life on a vivid 6. 4&quot; Full HD+ display.<br />\r\nUltra-responsive performance + 128 GB storage. Feel the blazing speed of an octa-core processor&mdash;and never worry about storage space.<br />\r\n16 MP low-light selfie cam. Always look your best and brightest thanks to Quad Pixel technology and 4x low light sensitivity.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/f0c904cc-bd24-460d-8f05-b5fac451e18e.__CR0,0,970,300_PT0_SX970_V1___ (2)_1607941819.jpg\" style=\"height:343px; width:1110px\" /></p>\r\n\r\n<p><br />\r\nWi-Fi Hotspot Ready: Moto G Stylus offers Wi-fi hotspot connectivity in 2.4 GHz + 5 GHz for the best experience.<br />\r\nOperating System: Android</p>\r\n\r\n<p>Brand&nbsp;&nbsp; &nbsp;Motorola<br />\r\nConnectivity Technology&nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi<br />\r\nModel Name&nbsp;&nbsp; &nbsp;Moto G stylus 2020 US - XT2043-4<br />\r\nColor&nbsp;&nbsp; &nbsp;Blue<br />\r\nconnector-type&nbsp;&nbsp; &nbsp;USB Type C</p>', 20, 'moto-g-stylus-unlocked17', '801607941858.jpg', '779.00', 'discount', '750.00', NULL, NULL, 'fixed', '779.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-14 00:34:22', '2020-12-14 00:34:22'),
(304, 'Motorola Edge unlocked', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nUnlocked for the freedom to choose your carrier. 4G compatible with AT&amp;T, Sprint, T-Mobile, and Verizon networks. Sim card not included. Customers may need to contact Sprint for activation on Sprint&rsquo;s network<br />\r\nIn order to use this Device on Verizon first provision your SIM through Verizon Wireless . Log in to your account on Verizon Wireless . Devices &gt; activate or switch devices &gt; activate. Alternatively, call/visit a Verizon store.<br />\r\nUltra-powerful 5G performance - Experience pure speed with the next gen wireless network, plus an insanely fast processor, 6GB memory, and 256GB storage. Compatible with T-Mobile&#39;s 5G network now. Ready for 5G on other networks dependent on carrier availability.<br />\r\nImmersive 90 Hz Endless Edge display - Get breathtaking HDR10 picture quality on a gorgeous 6.7&rdquo; OLED display that wraps around the edges.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/f0242b76-5df6-451c-b031-7e2daabab9b7.__CR0,0,970,300_PT0_SX970_V1____1607942371.jpg\" style=\"height:343px; width:1110px\" /></p>\r\n\r\n<p><br />\r\n64MP Triple Camera System - Class-leading camera resolution lets you capture everything from super high-res to crisp low-light, and from ultra-wide to ultra-zoom.<br />\r\n6GB RAM + 256GB Storage - Plus, motorola edge comes loaded with 6GB memory and 256GB of storage.<br />\r\nUp to 2 day battery + Turbo Charging - Free yourself from power outlets with the class-leading 4500 mAh battery, and fuel up fast with TurboPower.<br />\r\nPowerful Stereo Sound - The highest output of any smartphone and award-winning audio tuning technology deliver studio-quality sonic performance.<br />\r\nWi-Fi Hotspot Ready: Motorola Edge offers Wi-fi hotspot connectivity in 2.4 GHz + 5 GHz for the best experience.<br />\r\nIn-box: Motorola Edge 256GB Unlocked, Protective back cover, 18W Charger, USB Cable, Guides, SIM tool</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nExperience 5G speeds with this unlocked Motorola edge smartphone. The 6.7-inch OLED display wraps around the edges to deliver a clear picture quality with a 90 HZ refresh rate. The Motorola edge smartphone has a 64MP triple-camera system for low-light, high-res, ultra-wide, and ultra-zoom photos. Plus, Motorola Edge comes with 6GB memory, and the 256GB of storage holds your files and applications. The 4500mAh rechargeable battery delivers up to two days of use, and the stereo sound delivers studio-quality performance. Wi-Fi - Wi-Fi 802.11 a/b/g/n/ac | 2.4GHz &amp; 5GHz | Wi-Fi hotspot<br />\r\nService Provider&nbsp;&nbsp; &nbsp;Global Smartphone - Unlocked<br />\r\nBrand&nbsp;&nbsp; &nbsp;Motorola<br />\r\nDisplay Size&nbsp;&nbsp; &nbsp;6.7 Inches<br />\r\nOperating System&nbsp;&nbsp; &nbsp;Android 10.0<br />\r\nMemory Storage Capacity&nbsp;&nbsp; &nbsp;256 GB<br />\r\n&nbsp;</p>', 20, 'motorola-edge-unlocked', '871607942398.jpg', '1029.00', 'fixed', NULL, NULL, NULL, 'fixed', '1029.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-14 00:40:51', '2020-12-14 00:40:51'),
(306, 'Motorola One Hyper 5G', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nInternational model phone, Does not have US warranty. Compatible with Most GSM SIM cards in U.S. and world Including AT&amp;T, T-Mobile, MetroPCS, Etc.Will NOT work with CDMA Carriers Such as Verizon, Sprint, Boost.<br />\r\n6.5&rdquo; Total Vision Display, FHD+ (1080x2340), 395ppi, 19:9, 4000mAh Battery, 45W Hyper Charging<br />\r\nInternal Storage: 128GB, ROM: 4GB, Expandable Storage Up to 1TB microSD card, Qualcomm SDM675 Snapdragon 675, Octa-core Processor<br />\r\nQuad Pixel technology : Dual Rear Camera-64MP (f/1.9, 0.8um) + 8MP (f/2.2, 1.12um), Front Camera-Motorized pop-up 32MP (f/2.0, 0.8um), Android 10, Bluetooth 5.0<br />\r\n2G bands: GSM 850 / 900 / 1800 / 1900, 3G bands: HSDPA 850 / 900 / 1700(AWS) / 1900 / 2100, 4G bands: LTE band 1(2100), 2(1900), 3(1800), 4(1700/2100), 5(850), 7(2600), 8(900), 12(700), 17(700), 28(700), 66(1700/2100)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Product description</strong><br />\r\nWith its 48 MP, AI-powered triple camera system, moto g stylus captures outstanding shots in every situation. Sharper, brighter low-light photos with a 48 MP1 main sensor featuring Night Vision. Thrilling ultra-wide action videos. And incredibly detailed close-up shots up to 2cm away. Want to edit your photos with pinpoint precision? Slide out the stylus to retouch an image or jot down a note. View it all on a 6. 4&quot; Max Vision Full HD+ display, and enjoy dual stereo speakers tuned by Dolby. All this, along with up to two days of battery life, lightning-fast performance, and 128 GB of storage. moto g stylus. You + perfection.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;6.24 x 2.99 x 0.36 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;6.8 ounces<br />\r\nASIN&nbsp;&nbsp; &nbsp;B084CVPLLC<br />\r\nItem model number&nbsp;&nbsp; &nbsp;XT2043-4<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\nOS&nbsp;&nbsp; &nbsp;Android<br />\r\nRAM&nbsp;&nbsp; &nbsp;4 GB<br />\r\nConnectivity technologies&nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi<br />\r\nAdditional Features&nbsp;&nbsp; &nbsp;Touchscreen, Video Calling, Fast Charging Support, Expandable Memory, Fingerprint Sensor, Smartphone, Mobile Hotspot Capability, Water Resistant<br />\r\nOther display features&nbsp;&nbsp; &nbsp;Wireless<br />\r\nOther camera features&nbsp;&nbsp; &nbsp;48 MP camera<br />\r\nForm Factor&nbsp;&nbsp; &nbsp;Smartphone<br />\r\nColour&nbsp;&nbsp; &nbsp;Blue<br />\r\nBattery Power Rating&nbsp;&nbsp; &nbsp;4000<br />\r\nIncluded Components&nbsp;&nbsp; &nbsp;SIM tool, User Guides, 10W rapid charger, Device - moto g stylus, USB Type-C cable<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Motorola</p>', 20, 'motorola-one-hyper-5g', '161607942763.jpg', '799.00', 'fixed', NULL, NULL, NULL, 'fixed', '799.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-14 00:46:22', '2020-12-23 00:36:11'),
(307, 'Motorola One Zoom', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\n6.4&quot; Full HD+ (2340 x 1080p) Max Vision OLED capacitive touchscreen with U-notch display - On-display fingerprint sensor, face unlock - P2i splash-proof nano-coating<br />\r\n128GB + 4GB RAM - Qualcomm Snapdragon 675 Mobile Platform - microSD Card support (up to 1 TB)* - Battery Size 4000 mAh - Body 6000 series polished aluminum frame - USB 3.1 (Type C) reversible connector, 3.5mm headphone jack<br />\r\nRear Camera: (Quad camera) 48MP + 16MP ultrawid + 8MP telephoto + 5MP depth sensor - Front Camera: 25 megapixels f/2.0 (aperture) - OIS: Optical stabilization - 4K UHD (3840x2160 pixels) 30 fps<br />\r\n2G bands: GSM 850 / 900 / 1800 / 1900, 3G bands: HSDPA 850 / 900 / 1700(AWS) / 1900 / 2100, 4G bands: LTE band 1(2100), 2(1900), 3(1800), 4(1700/2100), 5(850), 7(2600), 8(900), 12(700), 17(700), 20(800), 28(700), 38(2600), 40(2300), 41(2500), 66(1700/2100)<br />\r\nInternational model phone, will work with Most GSM SIM cards in U.S. and world Including AT&amp;T, T-Mobile, MetroPCS, Etc. Does not have US warranty. Will NOT work with CDMA Carriers Such as Verizon, Sprint, Boost.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/51UKFhzTW4L._AC_SL1403__1607943275.jpg\" style=\"height:517px; width:1110px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Product description</strong><br />\r\nColor:Grey Techno&nbsp; |&nbsp; Size:128 GB<br />\r\nIntroducing Motorola one zoom with its industry-leading quad-camera system. With a 48 MP Sensor with OIS, high-res optical zoom, an ultra-wide-angle lens and more, it gives you the perfect camera for every moment.</p>\r\n\r\n<p>6.4&quot; OLED display with a fingerprint sensor.<br />\r\nBring photos and movies to life on a vivid display that unlocks instantly with a fingerprint reader that appears only when you need it.</p>\r\n\r\n<p>Qualcomm Snapdragon mobile platform<br />\r\nA powerful processor drives outstanding gaming capabilities, the stellar camera features, AI smarts and smooth performance.</p>\r\n\r\n<p>make every shot shine<br />\r\nWith a 48 MP main sensor and Quad Pixel technology, Motorola one zoom delivers 4x better light sensitivity. So when you&rsquo;re shooting in low light situations, you get sharper and brighter 12 MP photos. And if your hands shake or the camera&rsquo;s bumped accidentally, Optical Image Stabilization (OIS) keeps photos blur-free.</p>\r\n\r\n<p>The closer, the better<br />\r\nThis isn&rsquo;t the zoom you&rsquo;re used to. Unlike digital zoom, high-res optical zoom lets you capture details from a distance without compromising picture quality. OIS keeps the lens steady so there&rsquo;s no blur even when fully zoomed.</p>\r\n\r\n<p>25 MP selfie camera<br />\r\nBe confident your selfies will turn out great day or night, indoors or out. In bright light, the 25 MP sensor captures even the smallest details. And in low light, Quad Pixel technology delivers 4x better light sensitivity so you always look your best and brightest.</p>\r\n\r\n<p>Up to 2-day battery life<br />\r\nGo up to 2 days on a single charge with a 4000 mAh battery.</p>\r\n\r\n<p>&nbsp;</p>', 20, 'motorola-one-zoom', '541607942979.jpg', '645.00', 'fixed', NULL, NULL, NULL, 'fixed', '645.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-14 00:49:57', '2020-12-14 00:55:24'),
(309, 'Nokia 2.4 android 10', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nCapture detailed shots on the Nokia 2.4 Android Smartphone after dark with its Night Mode advanced image fusion and exposure stacking.<br />\r\nPut your best face forward with Portrait Mode&#39;s custom shapes and blurred backgrounds, plus the phone features a new Portrait editor.<br />\r\nCharge less and get up to 2 days on a single charge with the 4500mAh AI-assisted Adaptive Battery.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1_1607943854.jpg\" style=\"height:343px; width:1110px\" /></p>\r\n\r\n<p><br />\r\nYour phone is ready for Android 11 and beyond. Get the latest features with three years of monthly security updates and two years of software upgrades.<br />\r\nUnlock your device quickly and easily with the convenient fingerprint sensor. Includes phone, charger, cable, and quick start guide.</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2_1607943871.jpg\" style=\"height:344px; width:1110px\" /></p>\r\n\r\n<p><strong>Product description</strong><br />\r\nThe Nokia 2.4 smartphone runs up to 2 days with the 4500mAh AI-assisted Adaptive Battery, takes detailed night shots with AI imaging, and unlocks easily with your fingerprint or a glance. Bring great stories to life with the impressive 6.5-inch HD+ 20:9 screen. Plus, it&#39;s ready for Android 11 and beyond so you can look forward to two years of Android upgrades and three years of monthly security updates.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nPackage Dimensions&nbsp;&nbsp; &nbsp;7.17 x 5.75 x 1.38 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;12.3 ounces<br />\r\nASIN&nbsp;&nbsp; &nbsp;B08JRF9L15<br />\r\nItem model number&nbsp;&nbsp; &nbsp;TA-1274<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)<br />\r\nOS&nbsp;&nbsp; &nbsp;Android 10.0<br />\r\nRAM&nbsp;&nbsp; &nbsp;2 GB<br />\r\nConnectivity technologies&nbsp;&nbsp; &nbsp;Bluetooth, Wi-Fi<br />\r\nAdditional Features&nbsp;&nbsp; &nbsp;Touchscreen, Text/Messaging, Camera, Fingerprint Sensor, Smartphone<br />\r\nOther display features&nbsp;&nbsp; &nbsp;Wireless<br />\r\nDevice interface - primary&nbsp;&nbsp; &nbsp;Touchscreen<br />\r\nAudio Jack&nbsp;&nbsp; &nbsp;3.5 mm<br />\r\nForm Factor&nbsp;&nbsp; &nbsp;Smartphone<br />\r\nColour&nbsp;&nbsp; &nbsp;Charcoal<br />\r\nIncluded Components&nbsp;&nbsp; &nbsp;Micro USB Cable, Quick start guide, Charger, Nokia 2.4 Android Smartphone<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;HMD Global</p>', 9, 'nokia-24-android-10', '661607943934.jpg', '145.00', 'fixed', NULL, NULL, NULL, 'fixed', '145.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-14 01:06:01', '2020-12-14 01:06:01'),
(310, 'Nokia 5.3 Fully Unlocked', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nGo big with the Nokia 5.3 smartphone&#39;s epic-sized 6.55-inch HD+ display and incredible quad rear camera that captures stunning pictures even in low light, helps you select your best shot, and creates professional-looking portraits.<br />\r\nCapture great detail with the quad camera&#39;s 13 MP main lens, get everything in the frame with the ultra-wide, 118-degree 5 MP lens, focus in on the tiniest details with the 2 MP macro lens, and create blurred bokeh images with the 2 MP depth sensor.<br />\r\nStay in the game for longer thanks to the dynamic Qualcomm Snapdragon 665 processor&#39;s silky smooth graphics and AI-assisted Adaptive Battery that saves energy for the apps you use the most and stays charged for up to 2 days.<br />\r\nThe Nokia 5.3 and Google Assistant utilize AI-powered machine learning to learn and adapt to you with every use, and the dedicated Google Assistant button makes it easy to ask questions, update calendars, check traffic, and more.<br />\r\nLoaded with Android 10 (and ready for Android 11), it also features 64 GB internal storage, MicroSD card support up to 512 GB, and WiFi and Bluetooth 4. 2 connectivity. It comes with a charger, Micro USB cable, and quick start guide (SIM card not included).<br />\r\nOperating System: Android 10.0<br />\r\nIncluded Components: Type-C Usb Cable</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/3_1608006384.jpg\" style=\"height:343px; width:1110px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1_1608006195.jpg\" style=\"height:343px; width:1110px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2_1608006334.jpg\" style=\"height:343px; width:1110px\" /><br />\r\n<strong>Product description</strong><br />\r\nColor:Charcoal<br />\r\nGo big with the Nokia 5.3 smartphone&#39;s epic-sized 6.55-inch HD+ display and incredible quad rear camera that captures stunning pictures even in low light, helps you select your best shot, and creates professional-looking portraits. Capture great detail with the quad camera&#39;s 13 MP main lens, get everything in the frame with the ultra-wide, 118-degree 5 MP lens, focus in on the tiniest details with the 2 MP macro lens, and create blurred bokeh images with the 2 MP depth sensor. Using AI technology, the Nokia 5.3 takes multiple photos with different lighting and exposure settings, and blends them into one perfect photograph. A front-facing 8 MP camera is great for selfies, and it features Biometric face recognition for quick, secure phone unlock. Stay in the game for longer thanks to the dynamic Qualcomm Snapdragon 665 processor&#39;s silky smooth graphics and AI-assisted Adaptive Battery that saves energy for the apps you use the most and stays charged for up to 2 days. Featuring Nokia&#39;s largest screen yet, the Nokia 5.3&#39;s HD+ screen with 20: 9 display ratio delivers a truly immersive experience while still fitting in your hand and your pocket. The Nokia 5.3 and Google Assistant utilize AI-powered machine learning to learn and adapt to you with every use, and the dedicated Google Assistant button makes it easy to ask questions, update calendars, check traffic, and more. Certified Android One, the Nokia 5.3 cell phone will receive two years of Android upgrades and three years of monthly security updates, ensuring your phone has the most up-to-date Android features. Loaded with Android 10 (and ready for Android 11), it also features 64 GB internal storage, MicroSD card support up to 512 GB, and WiFi and Bluetooth 4. 2 connectivity. It comes with a charger, Micro USB cable, and quick start guide (SIM card not included). Compatible with GSM networks in the US, including AT&amp;T, T-Mobile, Cricket, Tracfone, and Simple Mobile. HMD Global Oy is the exclusive licensee of the Nokia brand for phones &amp; tablets. Nokia is a registered trademark of Nokia Corporation.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nColor:Charcoal<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;6.47 x 3.02 x 0.33 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;6.5 ounces<br />\r\nASIN&nbsp;&nbsp; &nbsp;B088ZQK2CN<br />\r\nItem model number&nbsp;&nbsp; &nbsp;TA-1223<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;HMD Global</p>', 9, 'nokia-53-fully-unlocked', '311608005949.jpg', '235.00', 'fixed', NULL, NULL, NULL, 'fixed', '235.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-14 18:27:54', '2020-12-14 18:27:54');
