(311, 'Nokia 7.1 android 9.0 Pie', 3, 18, NULL, '<p><strong>About this item</strong><br />\r\nDiscover the power of the latest generation Qualcomm Snapdragon 636 that will let you reimagine what can be done on a smartphone, complete with 4GB of RAM and 64GB of storage and up to 400GB with a micro SD powered with an all day battery<br />\r\nBright, high contrast 2. 5D 5. 84&rdquo; FHD+ HDR screen with 2220x1080 resolution and 19: 9 aspect ratio with a Compact screen to body ratio of 80% and Corning Gorilla glass<br />\r\nDual 12+5MP rear camera for vibrant and stunning images and an 8MP selfie camera with an 84 degree FOV so everyone fits in the picture every time that utilizes HDR, Dual Sight, and pro camera modes to create unparalleled images<br />\r\nBuilt on the most advanced version of Android One that brings a Google designed software experience with a streamlined, easy to use interface and curated set of pre-installed Google apps and two years of OS upgrades<br />\r\nAll the latest connection options including NFC, Bluetooth 5. 0, OTG, fast USB Type-C charging, and a fingerprint sensor. LTE Bands supported on both GSM and CMDA networks (with Verizon): 1, 2, 3, 4, 5, 7, 8, 12, 13, 17, 28, 38, 40, 66</p>\r\n\r\n<p><strong>Product description</strong><br />\r\nColor:Steel<br />\r\nDiscover the power of the Nokia 7. 1 a modern and carefully crafted phone featuring the latest generation Qualcomm Snapdragon 636 mobile platform that will let you re-imagine what can be done on a smartphone. The Nokia 7. 1 has been built with the user in mind At every step of the process. We started with a bright, high contrast 2. 5D 5. 84&rdquo; Full HD+ screen that create brilliant saturated colors making your photos, videos, and apps look better than ever. The 2220x1080 resolution and HDR support saturates your screen and makes everything from text to icons sharper and cleaner. The all new 19: 9 aspect ratio and a compact screen to body ratio means that 95% of your phone is more screen and less borders all protected by Corning Gorilla Glass. The Nokia 7. 1 is made even more powerful by taking advantage of the efficiencies of Android One. With Android One from Google you have: the most advanced Android with no bloatware or confusing re-skins, monthly security updates, with Android 9. 0 Pie. The 4GB of RAM and 64GB storage of internal storage ensures that everything works just the way you want and if you find yourself needing more space, The Nokia 7. 1 storage is up expandable up to 400GB with a micro SD card. All that storage is put to use with the Dual 12+5MP rear camera that creates vibrant and stunning images utilizing HDR+ technology for photos and an 8MP selfie camera with an 84 degree FOV so everyone fits in the picture every time. The Nokia 7. 1 is made complete with all the latest connection options including NFC, Bluetooth 5. 0, OTG, a fingerprint sensor, USB Type-C fast charging that takes your phone to 50% charge in less than 30 minutes So you never have to stop for long. Stand up and tell your story with the Nokia 7. 1, a phone Built for you. NETWORK AND CONNECTIVITY: Network speed LTE Cat. 6, 300Mbps DL/50Mbps UL,WiFi 802.11 a/b/g/n/ac,Bluetooth 5.0,GPS/AGPS+GLONASS, NFC. PERFORMANCE: Operating system Android 10,RAM 3/4 GB LPPDDR4x,CPU Qualcomm Snapdragon 636. CAMERA: Primary camera Dual Main: 12 MP 2PD/AF/f1.8/1.28um, Dual second: 5 MP, BW/FF/f2.4/1.12um, Front-facing camera 8 MP FF/f2.0, Flash Dual flash. Sensors Ambient light sensor, Proximity sensor, Accelerometer (G-sensor), E-compass, Gyroscope, Fingerprint Sensor (on the back).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2)_1608013836.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nColor:Steel<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;5.89 x 2.83 x 0.31 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;1 pounds<br />\r\nASIN&nbsp;&nbsp; &nbsp;B07HD3QC65<br />\r\nItem model number&nbsp;&nbsp; &nbsp;TA-1085 S<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\nOS&nbsp;&nbsp; &nbsp;Android 9.0<br />\r\nRAM&nbsp;&nbsp; &nbsp;64 GB<br />\r\nDisplay resolution&nbsp;&nbsp; &nbsp;2220x1080<br />\r\nOther display features&nbsp;&nbsp; &nbsp;Wireless<br />\r\nDevice interface - primary&nbsp;&nbsp; &nbsp;Touchscreen<br />\r\nOther camera features&nbsp;&nbsp; &nbsp;12<br />\r\nForm Factor&nbsp;&nbsp; &nbsp;Touchscreen<br />\r\nColour&nbsp;&nbsp; &nbsp;Steel<br />\r\nIncluded Components&nbsp;&nbsp; &nbsp;Wall Adapter, Phone, Charging Cable, Manual<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Parktel - Nokia (retail)</p>', 9, 'nokia-71-android-90-pie', '161608013898.jpg', '460.00', 'discount', '399.00', NULL, NULL, 'fixed', '460.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-14 20:31:52', '2020-12-14 20:33:39'),
(312, 'PowerA Enhanced Wireless Controller', 1, 11, 23, '<p>Play your favorite Nintendo Switch games like a pro with this officially licensed PowerA Enhanced Wireless Controller. Designed for comfort during extended gaming sessions, this Bluetooth wireless controller features subtle Crash Team Racing Nitro-Fueled icon design, motion controls, Advanced Gaming Buttons, and standard ergonomic layout. Enjoy up to 30 hours of gameplay with new alkaline batteries (other variables affect play-time) or add your own rechargeable batteries.</p>\r\n\r\n<p><br />\r\n<strong>PowerA Enhanced Wireless Controller for Nintendo Switch - CTR Shadow</strong></p>\r\n\r\n<p>Play your favorite Nintendo Switch games* like a pro with this officially licensed PowerA Enhanced Wireless Controller. Built for comfort during extended gaming sessions, this Bluetooth wireless controller features motion controls, mappable Advanced Gaming Buttons, and standard ergonomic layout. Enjoy up to 30 hours of gameplay with new alkaline batteries** or add your own rechargeable batteries.</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1_1608034088.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p><strong>Gaming is better together</strong></p>\r\n\r\n<p>Nintendo Switch allows up to 8 controller connections in docked mode, or you can link up to 8 systems together to play in tabletop mode. Compared to Joy-Con controllers, Enhanced Wireless Controllers offer improved accuracy and comfort plus larger buttons. Now that you have a more affordable wireless option available in a variety of colors and designs, pick up one or more, gather your friends, and share the fun.</p>\r\n\r\n<p><br />\r\nASIN &nbsp;&nbsp; &nbsp;B07RJ9PPMW<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;2.6 x 6.3 x 6.4 inches; 9.6 Ounces<br />\r\nBinding &nbsp;&nbsp; &nbsp;Video Game<br />\r\nItem model number &nbsp;&nbsp; &nbsp;1512045-01<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;9.6 ounces<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;PowerA<br />\r\nBatteries &nbsp;&nbsp; &nbsp;2 AA batteries required. (included)<br />\r\nDate First Available &nbsp;&nbsp; &nbsp;May 1, 2019</p>', NULL, 'powera-enhanced-wireless-controller', '601608034122.jpg', '225.00', 'discount', '199.00', '2020-12-09', NULL, 'fixed', '225.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-15 02:09:23', '2020-12-15 02:09:23'),
(313, 'ROCCAT LEADR – Wireless Multi-Button RGB Gaming Mouse', 1, 13, 17, '<p><strong>&nbsp;About this item</strong></p>\r\n\r\n<p>Unrivalled wireless optics zero lag 1000Hz polling + 20H Battery all day gaming charging dock &amp; TOP-UP USB cable charging dock with status LEDs<br />\r\nROCCAT OWL-EYE Optical sensor unrelenting pointer precision with 12000DPI 32-bit Processor + 512Kb Memory for rapid macro storage and execution<br />\r\n14 ergonomic mouse buttons programmable + Solid 2D Titan wheel next-gen button layout featuring X-Celerator analog paddle + fin switch ROCCAT Easy-Shift[+] button duplicator technology<br />\r\nTwo-level RGB illumination customizable light system 16 8M colors ALIENWARE AlienFX lighting system compatible<br />\r\nROCCAT SWARM powered comprehensive driver &amp; software suite<br />\r\nUnrivalled wireless optics zero lag 1000Hz polling + 20H Battery all day gaming charging dock &amp; TOP-UP USB cable charging dock with status LEDs<br />\r\nNote : In case of Wireless mouse, the USB receiver will be provided inside or along with the mouse</p>\r\n\r\n<p>ROCCAT OWL-EYE Optical sensor unrelenting pointer precision with 12000DPI 32-bit Processor + 512Kb Memory for rapid macro storage and execution<br />\r\n14 ergonomic mouse buttons programmable + Solid 2D Titan wheel next-gen button layout featuring X-Celerator analog paddle + fin switch ROCCAT Easy-Shift[+] button duplicator technology<br />\r\nTwo-level RGB illumination customizable light system 16 8M colors ALIENWARE AlienFX lighting system compatible</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1_1608034320.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p><br />\r\nWireless Type &nbsp;&nbsp; &nbsp;2.4 GHz Radio Frequency<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;ROCCAT<br />\r\nSeries &nbsp;&nbsp; &nbsp;ROCCAT INC.<br />\r\nItem model number &nbsp;&nbsp; &nbsp;ROC-11-852<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;WINDOWS 10/8/7/XP<br />\r\nOperating System &nbsp;&nbsp; &nbsp;WINDOWS 10/8/7/XP<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;12 ounces<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;4 x 3 x 2 inches<br />\r\nItem Dimensions LxWxH &nbsp;&nbsp; &nbsp;4 x 3 x 2 inches<br />\r\nColor &nbsp;&nbsp; &nbsp;Black<br />\r\nPower Source &nbsp;&nbsp; &nbsp;Battery Powered<br />\r\nVoltage &nbsp;&nbsp; &nbsp;3.7 Volts<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;ROCCAT</p>', NULL, 'roccat-leadr-wireless-multi-button-rgb-gaming-mouse', '221608034362.jpg', '157.55', 'fixed', NULL, NULL, NULL, 'fixed', '157.55', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-15 02:13:26', '2020-12-15 02:25:09'),
(314, 'WFB Wireless Mouse Cool Gaming Mouse Ergonomic 2.4G', 1, 13, 17, '<p><strong>About this item</strong></p>\r\n\r\n<p>COOL STYLISH DESIGN&nbsp; Cool wireless mouse with stylish design can be used to provide good support and gaming experience. It is domineering when Gaming match. The Nano receiver can be stored in the back of the Ergonomic Optical Mouse (USB receiver hidden in the battery compartment).<br />\r\n2.4GHz WIRELESS MOUSE Ensures reliable connection with an increased working distance of up to 10m and eliminates delays, dropouts and interference.<br />\r\nResolution Optical 800/1200/1600 DPI Resolution Optical Tracking Technology provides more sensitivity than standard optical mice for smooth and precise tracking on a wide range of surfaces.<br />\r\nLOW ENERGE CONSUMPTION Auto Power Off (APO) for energy saving. The USB Wireless Mouse will be switched off automatically when the Nano Receiver is disconnected, or the PC is power off.<br />\r\nCompatible with For Windows XP, Vista, 7, 8, 8.1,10 and Linux. Works with Notebook, Chromebook, PC, Laptop, Computer, and more.(batteries are NOT included).</p>\r\n\r\n<p>Wireless Computer Mouse 2.4G Full Size Wireless Optical Gaming Mice with Nano USB Receiver</p>\r\n\r\n<p><strong>Mouse operation instructions:</strong></p>\r\n\r\n<p>1. Open the battery warehouse, load 2*AAA batteries, remove the USB receiver in the battery warehouse, cover the battery warehouse, and enter the boot mode.</p>\r\n\r\n<p>2. Insert the USB receiver into the computer&#39;s free USB port. The first time you install the computer, you will be prompted to find an available USB device, and it will be installed automatically. You can use the mouse normally.</p>\r\n\r\n<p>3. When the mouse is not operated for 3 minutes, it will automatically enter the standby state. It cannot be used. You can click the left mouse button to activate the mouse.</p>\r\n\r\n<p>4. If the mouse has not been used for a long time, please remove the battery in the battery warehouse to prevent the battery from leaking and damaging the mouse.</p>\r\n\r\n<p><strong>Package including:</strong></p>\r\n\r\n<p>Wireless Mouse * 1 (Not included batteries )</p>\r\n\r\n<p>USB Receiver * 1</p>\r\n\r\n<p>&nbsp;</p>', NULL, 'wfb-wireless-mouse-cool-gaming-mouse-ergonomic-24g', '891608035490.jpg', '79.00', 'fixed', NULL, NULL, NULL, 'fixed', '79.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-15 02:32:18', '2020-12-15 02:32:18'),
(315, 'Carry On Luggage Suitcase Plus', 14, 14, NULL, '<p><strong>All Aluminum Luggage 20inch Carry On Suitcase Spinner Hard-Shell Luggage with TSA Lock for Business Trip and Leisure Travel</strong></p>\r\n\r\n<p>All Aluminum Carry-On Luggage: No-zipper hard-shell Aluminum provides greater scratch-resistant and makes it much more durable.<br />\r\nExterior Features: Built in TSA approved lock for easy Customs inspect and passing. Aluminum telescoping more than 10 steps multi-level handle. Retractable buckle for hand bags and other.<br />\r\n360&deg; Spinner Wheels: With 4 set of multi-directional, double wheels to maneuver any directions smoothly and silently.<br />\r\nInterior Detachable Partitions: Interior organizer with 2 detachable zippered mesh partitions for securing items, such as iPad, laptop and toiletries, keeping your things tidy during your trip.<br />\r\nWarranty: 2 Years Warranty. 100% satisfactions service Guarantee. Feel free to contact us for any question to ask.</p>\r\n\r\n<p><strong>Features</strong><br />\r\nMade of premium aluminum, beautiful black luggage<br />\r\nBuilt-in TSA lock for ease of Customs security check<br />\r\nTelescoping aluminum handle with multi-level of height locking<br />\r\n4 set of 360&deg; double wheels spinner system<br />\r\nFully linen spacious interior<br />\r\n2 detachable zippered mesh partitions for keeping your small things safe and being organized<br />\r\n1 buckle for hanging your hand bag and other</p>\r\n\r\n<p><strong>Package Included</strong><br />\r\n1 x 20 inch All Aluminum Luggage<br />\r\n1 x Dust Proof Cover</p>\r\n\r\n<p><strong>How to Reset Code?</strong><br />\r\nInitial combination code &quot;000&quot; to open suitcases and reset.<br />\r\n1&gt; Press the button outside the lock, then you can hear a buzz, the lock was open.<br />\r\n2&gt; Pull the button inside the lock from &ldquo;off&rdquo; to &ldquo;on&rdquo;, then you can reset the code by scrolling the digital wheel.<br />\r\n3&gt; After you have set your code, please pull the button inside the lock from &ldquo;off&rdquo; to &ldquo;on&rdquo;.<br />\r\n4&gt; Congratulations! Your code was reset successfully.</p>', NULL, 'carry-on-luggage-suitcase-plus', '151608037522.jpg', '349.00', 'fixed', NULL, NULL, NULL, 'fixed', '349.00', NULL, NULL, NULL, 1, NULL, 1, 1, 1, 1, 0, 0, 0, NULL, '2020-12-15 03:05:53', '2020-12-15 03:37:33'),
(316, 'Briggs & Riley Delve Medium Backpack', 14, 14, NULL, '<p>&nbsp;WEATHER RESISTANCE FABRIC: Coated and woven polyester fabric means the entire bag resists wear, water and abrasion. It&#39;s ready to go wherever and whenever you are<br />\r\nLAPTOP PROTECTION: Large gusseted zip-around back section holds both your 15&quot; laptop and an 11&quot; tablet; there is also space for a change of clothes and two elastic pockets secure small personal items<br />\r\nTWO RFID BLOCKING POCKETS: One in front organizer and one on the back of the bag, provide options to protect personal data from digital pickpockets<br />\r\nSECURITY-MINDED ORGANIZATION: The outside pockets feature a turned edge profile, creating hidden zippers and adding style to your security<br />\r\nTRAVEL FRIENDLY: Deep SpeedThru pocket for quick storage of items at security checkpoints; orange lining alerts you if the pocket is open and Slip-through back panel allows bag to slide over the Briggs &amp; Riley Outsider handle<br />\r\nEXCEPTIONAL COMFORT: Adjustable padded backpack straps for maximum shoulder comfort; curved &quot;turned edge&quot; design maximizes shoulder and back ergonomics. Cushioned air mesh on the back panel and backpack straps provide a breathable fit<br />\r\nFEATURE PACKED: Self-repairing YKK zipper, Water bottle side pockets, durable, top carry handle, trigger snap key fob<br />\r\nDIMENSIONS &amp; CAPACITY: 17 x 12 x 6 in. / 43.1 x 30.5 x 15.2 cm , 2.3lbs , 23.2L storage capacity</p>\r\n\r\n<p>INTERIOR FEATURES A full-length main compartment zipper means you can access everything inside without undoing the flap or taking the bag off Unique, three-section design offers generous storage capacity in a small aesthetic Full-length zip-around main compartment doubles in size to accommodate large or bulky items and conveniently cinches down when carrying just a few essentials Zip-around middle compartment has pockets to organize your tech essentials and an RFID blocking pocket to protect your digital data An easily accessible trigger-snap key fob attached to the middle compartment ensures you&#39;ll never lose your keys mid-transit again! Zip-around back compartment is padded and can safely store up to an 11&quot; tablet EXTERIOR FEATURES PVC coated body fabric means that the entire bag resists wear, water and abrasion and is ready to go wherever and whenever you are Designed with security in mind, the most important compartments on the bag are close to your body. The outside pockets feature a turned edge profile, creating hidden zippers and adding style to your security Smooth metal hardware adjusts easily and does not snag or scratch your clothing or skin Self-repairing YKK zippers; sleek, ergonomic zipper pulls that can be locked together lock for added security (lock not included) Removable laser-cut metal dog tag with leather patch offers a custom personalization option Swivel hardware on strap ensures that strap cannot be twisted or put on backwards - one less thing to worry about! Smart placement of quick-release buckle on strap mitigates awkward over-the-head motions while placing bag on and off body Lash points on the strap to conveniently attach personal items like a carabiner or bike light, and the low-profile padding allows for a sleek aesthetic and an ultra-comfortable fit.</p>\r\n\r\n<p>Product Dimensions &nbsp;&nbsp; &nbsp;5.98 x 12.01 x 16.97 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;2.3 pounds<br />\r\nDepartment &nbsp;&nbsp; &nbsp;Unisex-adult<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Briggs &amp; Riley<br />\r\nASIN &nbsp;&nbsp; &nbsp;B086RL99RT<br />\r\nItem model number &nbsp;&nbsp; &nbsp;DV120-4</p>', NULL, 'briggs-riley-delve-medium-backpack', '151608178673.jpg', '350.00', 'fixed', NULL, NULL, NULL, 'fixed', '350.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 1, 0, 0, 0, NULL, '2020-12-16 18:18:34', '2020-12-16 18:18:34'),
(317, 'Dakine Carry On Roller 42L Wheeled Travel Bag (Lead Blue)', 14, 33, NULL, '<p>An impressive amount of space in a convenient Carry On size (most airlines), securely closes with a #10 YKK main zipper access<br />\r\nOur split level design with mesh divider and our exterior padded 17&quot; laptop sleeve pocket makes for easy access and organization while you travel<br />\r\nBuilt for travel efficiency with tuck away ID pocket for security, retractable handle &amp; replaceable 8cm urethane wheels<br />\r\nDimensions: 22 x 15 x 9&quot;<br />\r\nLimited Lifetime Warranty<br />\r\nIncluded Components: Wheeled Travel Bags</p>\r\n\r\n<p>NAVIGATE THE AIRPORT LIKE A PRO WITH THIS OVERHEAD-COMPATIBLE ROLLER BAG. The Dakine Carry On 42L is sized for weekend travel and meets the legal carry-on specs for most airlines. Its split-level layout keeps you organized while traveling, and internal compression straps help you fit that extra jacket. A dedicated laptop pocket keeps your mobile office within easy reach. Dakine was founded in Hawaii in 1979 and located at the base of Mt. Hood in Hood River, Oregon, builds backpacks, travel bags, and accessories, outerwear and clothing for people who love to surf, snowboard, skateboard, mountain bike, ski, windsurf, kiteboard and travel. Progress Is In Our DNA. We&#39;re challenging you to chase the unknown. To push against predictable and break away from comfort - to surf new breaks, ride steeper terrain, go where the wind howls and the trails push past the horizon. To go where you&#39;ve never gone, do what you&#39;ve never done and revel in the experience. We&#39;ll be right there with you.</p>\r\n\r\n<p><br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;22 x 8.5 x 14.5 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;6.64 pounds<br />\r\nDepartment &nbsp;&nbsp; &nbsp;Unisex<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Dakine<br />\r\nASIN &nbsp;&nbsp; &nbsp;B08264FP2S<br />\r\nItem model number &nbsp;&nbsp; &nbsp;10002923</p>', NULL, 'dakine-carry-on-roller-42l-wheeled-travel-bag-lead-blue', '911608178836.jpg', '459.00', 'fixed', NULL, NULL, NULL, 'fixed', '459.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-16 18:20:39', '2020-12-16 18:20:39'),
(318, 'RUVALINO Multifunction Travel Back Pack, Diaper Bag Backpack', 14, 14, NULL, '<p>Product Dimensions &nbsp;&nbsp; &nbsp;11.81 x 7.87 x 16.54 inches<br />\r\nItem model number &nbsp;&nbsp; &nbsp;YW168<br />\r\nIs Discontinued By Manufacturer &nbsp;&nbsp; &nbsp;No<br />\r\nSafety warning &nbsp;&nbsp; &nbsp;WARNING! To prevent stroller from tipping: Detach the bag from stroller before removing your child. To prevent strap entanglement when bag is hanging on stroller. If shoulder strap is attached, securely tuck it in closed bag, do not let it hang loose.<br />\r\nTarget gender &nbsp;&nbsp; &nbsp;Unisex<br />\r\nMaterial Type &nbsp;&nbsp; &nbsp;Polyester<br />\r\nmaterial_composition &nbsp;&nbsp; &nbsp;Outer and Lining: 100% water resistant polyester<br />\r\nCare instructions &nbsp;&nbsp; &nbsp;SPOT CLEAN OR HAND WASH COLD &amp; DRY FLAT<br />\r\nStyle &nbsp;&nbsp; &nbsp;Neutral Multifunction Diaper Bag Backpack<br />\r\nBest uses &nbsp;&nbsp; &nbsp;Mom/ dad shopping or travelling with baby<br />\r\nBatteries required &nbsp;&nbsp; &nbsp;No<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;1.9 pounds</p>', NULL, 'ruvalino-multifunction-travel-back-pack-diaper-bag-backpack', '971608179096.jpg', '265.00', 'fixed', NULL, NULL, NULL, 'fixed', '265.00', NULL, NULL, NULL, 1, NULL, 1, 1, 1, 0, 0, 0, 0, NULL, '2020-12-16 18:24:59', '2020-12-16 18:28:08'),
