(321, 'Nike Xtreme Sports', 14, 14, NULL, '<p>Here comes the Nike backpack in black, which provides you with optimal equipment. Founded in 1971 and established worldwide top manufacturer from the US state of Oregon brings herewith an excellent model at the start. He has front pockets. Even fully packed, The backpack can be worn easily and comfortably With padded straps. With a length of 13 cm, A width of 30 cm and A height of 45 cm It convinces; your stuff Is so well stowed away on the way to Training or Game. Your things are first-class stowed on the way to Training or play. Product details: front Pockets for storing trifles size: 13x30x45 cm with adjustable straps and specialized compartments, The Nike academy team kids&#39; Football backpack delivers personalised comfort and functional storage.Pitch ready storage Laser-perforated wet/dry compartment helps keep gear clean and organizer. Mesh pocket of the side for water bottle storage. Large, dual-zippered main compartment provides secure storage for your gear. Curved shoulder straps and back panel are padded for comfortable carrying. Back pocket Features a felt interior For phone or key storage. Fabric: 100% Polyester.</p>\r\n\r\n<p><br />\r\n&nbsp;The front pocket has storage space for the ball.<br />\r\nIn Laserperforierten compartment for wet and dry items store your equipment neat and tidy.<br />\r\nMesh pocket on the side to store drinks bottles.<br />\r\nThe large main compartment with double zip provides secure storage space for equipment.<br />\r\nRounded shoulder straps and use on the back of the screen it is padded for comfortable carrying.</p>', NULL, 'nike-xtreme-sports', '951608179852.jpg', '435.00', 'fixed', NULL, NULL, NULL, 'fixed', '435.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 1, 0, NULL, '2020-12-16 18:37:39', '2020-12-16 18:37:39'),
(322, 'Samsonite Omni PC Hardside Expandable Luggage with Spinner Wheels', 14, 33, NULL, '<p>28&quot; Spinner luggage maximizes your packing power and is the ideal checked bag for longer trips<br />\r\nPacking dimensions: 28.5&quot; X 20.5&quot; X 13.5&quot;, overall dimensions: 30.5&quot; X 21.5&quot; X 13.5&quot;, weight: 10.35 lbs.<br />\r\n10 year limited warranty: Samsonite products are rigorously tested to ensure our products meet stringent standards. This bag comes with a 10-year warranty against defects in materials and workmanship.<br />\r\nMicro diamond polycarbonate texture is extremely scratch resistant, keeping cases beautiful trip after trip<br />\r\nSide mounted TSA locks act to deter theft, ensuring that only you or a TSA agent have easy access to your belongings when traveling</p>\r\n\r\n<p>Four, multi-directional oversized spinner wheels for effortless mobility, re-engineered lightweight<br />\r\nBook opening case with mesh divider and cross straps in main compartment with a zipped modesty pocket</p>\r\n\r\n<p>Expansion to allow you to pack more items and compression keeps clothing neatly pressed<br />\r\nPush-button locking handles provides easy maneuverability when extended out from the suitcase, and stores neatly inside when not in use</p>\r\n\r\n<p>Introducing a line built to take the harshest travel elements Omni PC combines scratch resistant textures with the lightest 100% polycarbonate construction, ensuring your luggage looks as great on the 100th trip as it does on the 1st. This lightweight line offers heavyweight protection riding on effortless 360 spinner wheels. Don&#39;t pull your case; let Omni PC roll comfortably beside you on your journey. Design includes expansion for added capacity when needed. TSA locks ensure your belongings arrive safely to your destination. Extremely lightweight and visually impactful, this collection takes 100% polycarbonate design to the next level. Hardside Care: To clean hardside luggage, we recommend using a gentle soap and warm water, rinsing well. If you would like to wax the case after cleaning, any good silicone-base automobile or furniture polish will preserve the luster and add resistance to the covering. We do NOT recommend, however, that you try to clean the luggage with a combination cleaner-polish. Shell material is made of injection molded polycarbonate, a highly impact-resistant plastic that is strong and lightweight.</p>\r\n\r\n<p><br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;13.5 x 21.5 x 30.5 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;14 pounds<br />\r\nDepartment &nbsp;&nbsp; &nbsp;Unisex-adult<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Samsonite Corporation<br />\r\nASIN &nbsp;&nbsp; &nbsp;B071HFNFYP<br />\r\nItem model number &nbsp;&nbsp; &nbsp;68310-1776</p>', NULL, 'samsonite-omni-pc-hardside-expandable-luggage-with-spinner-wheels', '101608180127.jpg', '679.00', 'fixed', NULL, NULL, NULL, 'fixed', '679.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-16 18:42:19', '2020-12-16 18:42:19'),
(323, 'Gevi 4 Cup Coffee Maker, Small Drip Coffee Maker, Compact Coffee Machine Work in Silent', 4, 21, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>Easy Operation Just press the ON/OFF switch to brew and enjoy flavorful coffee in minutes. ON/OFF indicator light lets you know when your coffee maker is on or off.<br />\r\n30s Auto Pause Allows for pouring a cup at any time during the brew cycle, and the coffee will not drip within 30 seconds.<br />\r\nKeep-Warm Keep coffee warm, fresh and flavorful with warming plate.<br />\r\nBoil-Dry Protection the brewing will automatically stop for boil-dry protection when there is no water in the water tank or the temperature exceeds the rated temperature.<br />\r\nCompact Size and Easy to CleanSpace-saving 4 cup coffee machine with visible 600ml large capacity tank, perfect for home and Office use. Detachable filter and funnel for easy cleaning.</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2)_1608181946.jpg\" style=\"height:605px; width:1090px\" /><br />\r\n<strong>Gevi 4-Cup Compact Size Drip Coffee Machine</strong></p>\r\n\r\n<p>We are committed to provide you a best brewing experience. Having a Gevi 4-Cup Compact Size Drip Coffee Maker allow you offer a selection of delicious coffee drinks,all you need to do is to press one button and machine does the work for you.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; One-touch control for easy operation<br />\r\n&nbsp;&nbsp;&nbsp; Grab-A-Cup Auto Pause<br />\r\n&nbsp;&nbsp;&nbsp; Keep-Warm function<br />\r\n&nbsp;&nbsp;&nbsp; Overheating Protection<br />\r\n&nbsp;&nbsp;&nbsp; Reusable filter and removable filter basket<br />\r\n&nbsp;&nbsp;&nbsp; Lighted ON/OFF switch for peace of mind<br />\r\n&nbsp;&nbsp;&nbsp; Compact size with enough capacity<br />\r\n&nbsp;&nbsp;&nbsp; Easy-view water window</p>\r\n\r\n<p>Material &nbsp;&nbsp; &nbsp;Plastic<br />\r\nBrand &nbsp;&nbsp; &nbsp;Barsetto<br />\r\nColor &nbsp;&nbsp; &nbsp;Black<br />\r\nCapacity &nbsp;&nbsp; &nbsp;600 Milliliters<br />\r\nVoice command &nbsp;&nbsp; &nbsp;Buttons</p>\r\n\r\n<p>Reusable Filter and Removable Filter Basket</p>\r\n\r\n<p>No need to spend money on disposable paper filters, and easy for cleaning.<br />\r\n&nbsp;</p>', NULL, 'gevi-4-cup-coffee-maker-small-drip-coffee-maker-compact-coffee-machine-work-in-silent', '71608181790.jpg', '789.00', 'fixed', NULL, NULL, NULL, 'fixed', '789.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-16 19:12:55', '2020-12-23 00:34:00'),
(324, 'Hamilton Beach Works with Alexa Smart Coffee Maker, Programmable, 12 Cup Capacity', 4, 21, NULL, '<p><strong>About this item</strong><br />\r\nAlexa turn on my coffee maker smart 12 cup coffee maker works with Alexa giving you the ability to ask your Alexa app or Alexa smart speaker to start brewing change brew strength or turn off the coffee maker the clock automatically keeps the correct time by syncing wirelessly with the app you can easily program for wake-up ready coffee using routines in the Alexa app visit the Alexa app regularly to learn new functions or things to say as launches new commands<br />\r\nCertified for humans - Struggle-free, tinker-free, stress-free no patience needed - it&#39;s actually simple<br />\r\nWorks with Alexa this smart coffee maker is &quot;works with Alexa certified&quot; meeting a high bar for responsiveness reliability &amp; functionality few smart coffee makers are able to achieve works with Alexa certification which ensures the best smart home experience with your Alexa app or echo device<br />\r\nNo need to download additional apps to control the coffee maker you only need the Alexa app to turn the connected brewer on or off also use the Alexa app to set morning routines to program to brew which gets you out the door even faster<br />\r\nEasily add coffee and water from the front the front fill design of the reservoir lets you add water without moving the smart coffee maker from under the cabinets the brew basket uses a standard coffee filter and swings out for front filling<br />\r\nPeace of mind never leave the house wondering if the coffee maker is still on turn it off using the alexa app or by saying &quot;Alexa turn off my coffee maker&quot; if you forget auto shutoff automatically turns off the heating plate after 2 hours<br />\r\nMess-free serving pour a cup without messy spills or drips the glass carafe is designed with a drip-free pour spout so every drop makes it into your mug<br />\r\nBrew great-tasting coffee choose between regular or bold brew strengths manually or via the Alexa app &quot;Alexa set brew strength to bold&quot;</p>\r\n\r\n<p><strong>Product description</strong><br />\r\nStyle:Smart Coffee Maker<br />\r\nControl this 12 cup connected coffee maker with the Alexa app or your smart speaker for voice-enabled brewing or automatic brewing visit the Alexa app regularly to learn new functions or things to say as launches new commands.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nStyle:Smart Coffee Maker<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;7.95 x 13.25 x 13.9 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;4.58 pounds<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Hamilton Beach<br />\r\nASIN&nbsp;&nbsp; &nbsp;B07TFLNDNR<br />\r\nItem model number&nbsp;&nbsp; &nbsp;49350</p>', NULL, 'hamilton-beach-works-with-alexa-smart-coffee-maker-programmable-12-cup-capacity', '881608182210.jpg', '499.00', 'fixed', NULL, NULL, NULL, 'fixed', '499.00', NULL, NULL, NULL, 1, NULL, 1, 1, 1, 0, 0, 1, 0, NULL, '2020-12-16 19:17:04', '2020-12-16 19:22:31'),
(325, 'Keurig K-Classic Coffee Maker, Single Serve K-Cup Pod Coffee Brewer, 6 to 10 Oz', 4, 21, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Brews multiple k cup pod sizes: (6, 8, 10 ounce) the most popular k cup pod brew sizes; use the 6 ounce brew size to achieve the strongest brew<br />\r\n&nbsp;&nbsp;&nbsp; Large 48 ounce water reservoir: Allows you to brew 6+ cups before having to refill, saving you time and simplifying your morning routine; The water reservoir is removable, making it easy to refill whenever you need to<br />\r\n&nbsp;&nbsp;&nbsp; Descaling: An important part of cleaning your keurig brewer; this process helps to remove calcium deposits, or scale, that can build up inside a coffee maker over time<br />\r\n&nbsp;&nbsp;&nbsp; Auto off: An auto off feature is easily programmed to turn off your coffee maker after it has been idle for two hours, helping to save energy. Removable Drip Tray<br />\r\n&nbsp;&nbsp;&nbsp; Simple button controls: Just insert a pod, select your desired cup brew size, and brew a great tasting cup in under a minute</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (1) (2)_1608183326.jpg\" style=\"height:447px; width:1090px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2)_1608183351.jpg\" style=\"height:447px; width:1090px\" /></p>\r\n\r\n<p><br />\r\n<strong>Product Description</strong></p>\r\n\r\n<p>The Classic Keurig K-Cup Single Serve Coffee Maker, and a perennial best-seller, the Keurig K-Classic brews a rich, smooth, and delicious cup every time with the quality you expect from Keurig. Simple touch buttons make your brewing experience stress free, and multiple K-Cup pod brew sizes help to ensure you get your perfect cup. Whether you like your coffee strong, mild, decaf, or flavored, you can brew all of your favorites with the Keurig K-Classic andndash; and with large 48oz water reservoir, you can brew 6+ cups before having to refill. Discover hundreds of K-Cup pod varieties from all of the brands you love, including Green Mountain Coffee, Starbucks, and Lipton, and enjoy coffee, tea, hot cocoa and more. Also available in a two fun colors to complement your dandeacute;cor, and compatible with the Keurig Classic Series My K-Cup Reusable Coffee Filter, so you can brew your own ground coffee.</p>\r\n\r\n<p><strong>How do I fix a short cup:</strong><br />\r\nIf your brewer is not brewing the full amount selected, it may be caused by the following,<br />\r\nThe exit needle is clogged by coffee grounds or cocoa mix.<br />\r\nThe brewer may need to be descaled.<br />\r\nThe removable water reservoir was removed during brewing. Place the water reservoir back onto the brewer and perform a cleansing brew without a portion pod.</p>\r\n\r\n<p>Product Dimensions &nbsp;&nbsp; &nbsp;9.75 x 14 x 13.5 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;2 pounds<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Keurig<br />\r\nASIN &nbsp;&nbsp; &nbsp;B01BOU6DLE<br />\r\nItem model number &nbsp;&nbsp; &nbsp;K-Classic<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium ion batteries required.</p>', NULL, 'keurig-k-classic-coffee-maker-single-serve-k-cup-pod-coffee-brewer-6-to-10-oz', '231608183446.jpg', '569.00', 'fixed', NULL, NULL, NULL, 'fixed', '569.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 05:37:35', '2020-12-17 05:37:35'),
(327, 'Keurig K-Select Coffee Maker, Single Serve K-Cup Pod Coffee Brewer, With Strength Control', 4, 21, NULL, '<p><strong>About this item</strong><br />\r\nWHAT&#39;S IN THE BOX: One water filter handle, and one filter to help ensure your beverages taste their absolute best<br />\r\nBREWS MULTIPLE CUP SIZES: (6, 8, 10, 12 oz.). Enjoy the most popular cup sizes all with QUIET BREW TECHNOLOGY, minimizing noise during use<br />\r\nLARGE 52 oz. WATER RESERVOIR: Allows you to brew 5 cups before having to refill, saving you time and simplifying your morning routine. Removable reservoir makes refilling easy<br />\r\nSIMPLE BUTTON CONTROLS: Just insert a pod, select your desired cup brew size, and get fast &amp; fresh brewed, delicious coffee in minutes<br />\r\nREMOVABLE DRIP TRAY: Accommodates travel mugs up to 7.4&rdquo; tall, and holds a full accidental brew for easy cleanup<br />\r\nREMOVABLE DRIP TRAY: Accommodates travel mugs up to 7.4&rdquo; tall, and holds a full accidental brew for easy cleanup<br />\r\nDISPENSE HOT WATER: Open and close the brewer handle (without a pod) and select your cup size for hot water on demand</p>\r\n\r\n<p><img alt=\"coffee\" src=\"http://192.168.0.102/sell/images/1 (6) (2)_1608184157.jpg\" style=\"height:447px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (1) (2)_1608184223.jpg\" style=\"height:447px; width:1090px\" /><br />\r\n<strong>Product description</strong><br />\r\nColor:Matte Navy<br />\r\nThe Keurig K-Select single serve coffee maker combines sleek design and more intuitive features to help you brew your perfect cup every single time. It features four brew sizes, so you can brew 6, 8, 10, or up to 12 oz. of your favorite coffee, tea, hot cocoa, or iced beverage with the touch of a button. And for those who like a stronger cup of coffee, the Keurig K-Select brewer is the perfect choice. The Strong Brew feature kicks up your coffee&rsquo;s strength and intensity, so you can enjoy a bolder brew. Choose from hundreds of delicious varieties of K-Cup pods, or brew your own ground coffee with the My-K-Cup Universal Reusable Coffee Filter (sold separately). With the K-Select brewer, you can brew 5 cups between refills of the large 52 oz. water reservoir.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nColor:Matte Navy<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;11.6 x 9.2 x 12.5 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;8.45 pounds<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Keurig<br />\r\nASIN&nbsp;&nbsp; &nbsp;B078M1YRBY<br />\r\nItem model number&nbsp;&nbsp; &nbsp;K-Select</p>', NULL, 'keurig-k-select-coffee-maker-single-serve-k-cup-pod-coffee-brewer-with-strength-control', '61608184065.jpg', '455.00', 'fixed', NULL, NULL, NULL, 'fixed', '455.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 05:50:53', '2020-12-17 05:50:53'),
(328, 'Mr. Coffee Simple Brew Coffee Maker4 Cup Coffee MachineDrip Coffee Maker', 4, 21, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; On/off indicator light lets you know when your coffee maker is on or off<br />\r\n&nbsp;&nbsp;&nbsp; Grab-A-Cup Auto Pause stops cycle if you need a cup (1 cup = 5 oz) before brewing is finished<br />\r\n&nbsp;&nbsp;&nbsp; Dual water window allows visibility as you fill&acirc;&euro;&rdquo;no more overflows<br />\r\n&nbsp;&nbsp;&nbsp; Removable filter basket for quick and easy cleanup<br />\r\n&nbsp;&nbsp;&nbsp; Stain-resistant warming plate is easy to clean.Watts: 650</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2 (1)_1608184565.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p><br />\r\n<strong>Mr. Coffee 4-Cup Coffee Maker</strong><br />\r\nSimple &#39;n Easy Brewing</p>\r\n\r\n<p>Helps you make rich-tasting, expertly brewed coffee without stress or mess. Should you need a cup before the brew cycle is finished, Grab-A-Cup Auto Pause is a lifesaver. It stops brewing so you can pour freely, and then finishes the brewing cycle after you place the carafe back in position. It also features a removable basket filter that lifts out for quick and easy filling and cleaning. Whether you want a single cup or 4.</p>\r\n\r\n<p><strong>Product description</strong><br />\r\nSize:Medium&nbsp; |&nbsp; Color:Black</p>\r\n\r\n<p>The classic functionality of Mr. Coffee&#39;s Simple Brew 4-Cup Coffee Maker helps you make rich-tasting, expertly brewed coffee without stress or mess. Should you need a cup before the brew cycle is finished, Grab-A-Cup Auto Pause is a lifesaver. It stops brewing so you can pour freely, and then finishes the brewing cycle after you place the carafe back in position. It also features a removable basket filter that lifts out for quick and easy filling and cleaning. Whether you want a single cup or 4, this no-fuss automatic coffee maker will deliver the goods, time after time.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nSize:Medium&nbsp; |&nbsp; Color:Black<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;10.1 x 7.25 x 11.8 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;2.87 pounds<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Mr. Coffee<br />\r\nASIN &nbsp;&nbsp; &nbsp;B003W8JSH8<br />\r\nItem model number &nbsp;&nbsp; &nbsp;DR5-RB</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, 'mr-coffee-simple-brew-coffee-maker4-cup-coffee-machinedrip-coffee-maker', '791608184527.jpg', '365.00', 'fixed', NULL, NULL, NULL, 'fixed', '365.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 1, NULL, '2020-12-17 05:57:11', '2020-12-17 05:57:11'),
(329, 'Zojirushi EC-DAC50 Zutto 5-Cup Drip Coffeemaker', 4, 21, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; 650-watt drip coffeemaker brews up to 5 cups of coffee<br />\r\n&nbsp;&nbsp;&nbsp; Filter cone sits inside decanter making it more compact and easier to use<br />\r\n&nbsp;&nbsp;&nbsp; Concealed, removable water reservoir; automatic keep-warm function<br />\r\n&nbsp;&nbsp;&nbsp; Replaceable water filter; measuring spoon and user manual included<br />\r\n&nbsp;&nbsp;&nbsp; Measures 6 by 8-7/8 by 10-5/8 inches; 1-year limited warranty</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ZUTTO Coffee Maker EC-DAC50</strong></p>\r\n\r\n<p>The ZUTTO Coffee Maker features a removable water tank and water filter that lasts up to 2 years under normal use for clean operation. It brews up to 5 cups of coffee and features automatic keep warm.<br />\r\nWith Charcoal Water Filter</p>\r\n\r\n<p>Purifies water for better-tasting coffee and lasts up to 2 years under normal use.<br />\r\nSleek, Compact Design</p>\r\n\r\n<p>The cone basket is designed to be housed within the glass carafe, keeping the unit compact.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>About Zojirushi</strong></p>\r\n\r\n<p>In 2018, Zojirushi Corporation celebrated its 100th anniversary, and a century of products designed to improved customers&#39; quality of life--bringing comfort, ease, vitality and affluence to people around the world. Zojirushi was established in 1918 as a producer of hand-blown vacuum bottles. The Zojirushi line was expanded to include a wide range of stainless steel vacuum bottles, rice cookers, breadmakers, Air Pot beverage dispensers, thermal serving carafes, specialty cookware, small electrics, restaurant equipment and other products. Striving to remain faithful to the principles that embodied the company&#39;s first 100 years, and the reputation of quality and durability it earned them, Zojirushi looks forward to a future of continued innovation and inspired design.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Product description</strong></p>\r\n\r\n<p>The Zutto collection is Zojirushi&#39;s first collection of products that is designed and developed as a series of products. The concept of the Zutto collection was born as a result of the collaboration between Zojirushi and an interior designer in Japan. Unlike other Zojirushi products, the physical body of the Zutto was designed first, then the inner technology. Zutto (Zoot-tow), meaning &quot;always&quot; in Japanese, is designed to be enjoyed and used universally, for any occasion, anytime. This new Zutto Drip Coffee Maker is a convenient 5 cup size.<br />\r\nProduct information<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;6 x 9 x 11 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;4.69 pounds<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Zojirushi<br />\r\nASIN &nbsp;&nbsp; &nbsp;B000EPLK6O<br />\r\nDomestic Shipping &nbsp;&nbsp; &nbsp;Item can be shipped within U.S.<br />\r\nInternational Shipping &nbsp;&nbsp; &nbsp;This item can be shipped to select countries outside of the U.S. Learn More<br />\r\nItem model number &nbsp;&nbsp; &nbsp;EC-DAC50<img alt=\"coffee\" src=\"http://192.168.0.102/sell/images/2 (1)_1608184924.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p>&nbsp;</p>', NULL, 'zojirushi-ec-dac50-zutto-5-cup-drip-coffeemaker', '281608184805.jpg', '399.00', 'fixed', NULL, NULL, NULL, 'fixed', '399.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 06:00:11', '2020-12-17 06:04:44'),
(330, 'COMFEE\' 5.2Qt Asian Style Programmable All-in-1 Multi Cooker, Rice Cooker, Slow Cooker, Steamer', 4, 20, NULL, '<p><strong>About this item</strong><br />\r\nPerfect Rice Every Time - To achieve the ideal cooking performance, COMFEE&#39; has developed the intelligent 6-step cooking process that the steam valve and inner pot can preserve the steam and heat for perfect to simmer the fluffy rice every time.<br />\r\nCooking Versatility - The 17 digital cooking programs Japanese style rice cooker could suit eating habits like rice, pasta, soup, stew, saute, steamed veggies. Make specialty and healthy food in one cooker without owning 5 or more different appliances<br />\r\nHigh Safety - COMFEE&#39; electric multi rice cooker operating under the normal pressure with power, it is considered a safe alternative of all kinds pressure cooker or cooking on the stove. The cool touch handle ensures your safety when you open the cooker.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2)_1608185881.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p><br />\r\n10 Cup Ultra Capacity - 10 cup uncooked (5.2 Qt) capacity yielding anywhere from 10 to 20 cups of cooked rice, designed for families, parities, or any other outdoor activities. The non-stick coating, the cleaning of the inner pot is like a breeze. Note: Please use the measuring cup which comes along with the product<br />\r\nHumanized Designs - The rice cooker is user friendly with digital LED display and sensitive touch panel so your cooking could be set by simply pressing a button. It&#39;s flexible for meal planning with 24-hour delay timer and auto keep warm for 12 hours.<br />\r\nEasy to Clean - The cleaning of the stainless steel external housing and removable steam valve is like a breeze. The anti stick inner pot and all of the BPA Free plastic accessories that comes with the cooker can be washed in the dishwasher.<br />\r\nWarranty from COMFEE&#39; - This programmable electric rice cooker is made of BPA-free food grade material. UL certificate approved. COMFEE&#39; will provide 1 year manufacturer warranty together with your purchase.</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nComfee Multi- Function Rice Cooker Specifications Power: 890W Volume of Removable Bowl: 5.0 L Power Supply: AC120V 60Hz, Black Friday, Cyber Monday, rice cooker, rice cooker steamer, rice cooker and warmer, cooker pot, cooker steamer, cooker electric, cooker for rice, cooker machine, cooker multi-functional.</p>\r\n\r\n<p>Product Dimensions&nbsp;&nbsp; &nbsp;13.9 x 10.8 x 10.5 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;9 pounds<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;COMFEE&#39;<br />\r\nASIN&nbsp;&nbsp; &nbsp;B07CK58RPN<br />\r\nItem model number&nbsp;&nbsp; &nbsp;MB-FS5077<br />\r\n&nbsp;</p>', NULL, 'comfee-52qt-asian-style-programmable-all-in-1-multi-cooker-rice-cooker-slow-cooker-steamer', '541608185863.jpg', '139.00', 'fixed', NULL, NULL, NULL, 'fixed', '139.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 06:18:40', '2020-12-17 06:18:40');
