(331, 'Crock-Pot 6-Quart Countdown Programmable Oval Slow Cooker with Dipper with Pot', 4, 20, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>6-quart capacity is perfect for for 7 or more people or a 6-pound roast<br />\r\nRemovable oval stoneware that is also stylish for your table<br />\r\nProgrammable digital control lets you program cook times anywhere from 30-minute up to 20-hour<br />\r\nShifts to Warm Setting Automatically once the cook time is complete<br />\r\nDishwasher safe stoneware and lids for easy clean-up.Flat digital panel<br />\r\n6-quart capacity is perfect for 7 or more people or a 6-pound roast<br />\r\nRemovable oval stoneware that is also stylish for your table<br />\r\nProgrammable digital control lets you program cook times anywhere from 30 minutes up to 20 hours<br />\r\nShifts to warm setting automatically once the cook time is complete<br />\r\nDishwasher-safe stoneware and lids for easy clean-up</p>\r\n</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Crock-Pot SCCPVC605-S 6-Quart Countdown Slow Cooker with Little Dipper Warmer</strong></p>\r\n\r\n<p>Mealtime, on your time - the Crock-Pot Slow Cooker with Countdown Digital Timer. Whether your recipe calls for 30-minutes of quick heat or an all-day, while you&#39;re away, cooking session, the Crock-Pot Slow Cooker with Countdown Digital Timer and Little Dipper Warmer has it under control.</p>\r\n\r\n<p>You can customize your cooking time and temperature by setting the timer anywhere between 30-minutes and 20-hours on the High, Low, or Warm settings. The digital timer counts down the remaining time so you can coordinate side dish preparation and have a complete meal ready when you are. If you&#39;re not around when time runs out, this countdown expert will automatically shift to warm, maintaining temperature and flavor.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>16-ounce Little Dipper Warmer</strong><br />\r\nA 16-ounce Little Dipper Warmer is also included to keep your dips and sauces warm while serving. The Crock-Pot Countdown Slow Cooker was created with you and your busy schedule in mind. Enjoy dinner, on your time, at the touch of a button. Crock-Pot The Original Slow Cooker.</p>\r\n\r\n<p>Mealtime, on your time. The Crock-Pot Slow Cooker with Countdown Digital Timer. Whether your recipe calls for 30-minute of quick heat or an all-day, while you&#39;re away, cooking session, the Crock-Pot Slow Cooker with Countdown Digital Timer and Little dipper Warmer has it under control. You can customize your cooking time and temperature by setting the timer anywhere between 30-minute and 20-hour on the High, Low, or Warm settings. The digital timer counts down the remaining time so you can coordinate side dish preparation and have a complete meal ready when you are. If you&#39;re not around when time runs out, this countdown expert will automatically shift to Warm, maintaining temperature and flavor. The digital timer will count up the time that it has been operating on Warm for up to 6-hour, simplifying mealtime so you don&#39;t have to keep track. Serving your dish is a cinch. The 6-quart stoneware is removable and can go from countertop to tabletop. To keep clean up just as simple, both the oval stoneware and glass lid are dishwasher safe. And the modern stainless steel finish looks beautiful in any kitchen. The stylish, smudge-proof finish is perfect for your modern kitchen. A 16 ounce Little Dipper Warmer is also included to keep your dips and sauces warm while serving. The Crock-Pot Countdown Slow Cooker was created with you and your busy schedule in mind. Enjoy dinner, on your time, at the touch of a button. Crock-Pot The Original Slow Cooker.</p>\r\n\r\n<p><br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;14.5 x 9 x 14.5 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;8 pounds<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Crockpot<br />\r\nASIN&nbsp;&nbsp; &nbsp;B005D6FWAY<br />\r\nDomestic Shipping&nbsp;&nbsp; &nbsp;Item can be shipped within U.S.<br />\r\nInternational Shipping&nbsp;&nbsp; &nbsp;This item can be shipped to select countries outside of the U.S. Learn More<br />\r\nItem model number&nbsp;&nbsp; &nbsp;SCCPVC605-S</p>', NULL, 'crock-pot-6-quart-countdown-programmable-oval-slow-cooker-with-dipper-with-pot', '421608186083.jpg', '225.00', 'fixed', NULL, NULL, NULL, 'fixed', '225.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 06:21:29', '2020-12-17 06:21:29'),
(333, 'Crock-Pot SCV800-B, 8-Quart Oval Manual Slow Cooker, Black', 4, 20, NULL, '<p><strong>About this item</strong><br />\r\n8-quart oval manual Slow Cooker Serves 10+ people<br />\r\nHigh/Low cook settings, and convenient Warm setting<br />\r\nCrock-Pot features removable, dishwasher-safe stoneware insert<br />\r\nDishwasher-safe glass lid<br />\r\nPolished, brushed stainless steel exterior with black accents and plastic handles<br />\r\nIt s a healthier, more cost-efficient and convenient way to serve tasty, satisfying meals.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2) (2)_1608186548.jpg\" style=\"height:509px; width:1090px\" /></p>\r\n\r\n<p><br />\r\n<strong>Crock-Pot 8-Quart Oval Manual Slow Cooker</strong><br />\r\nAn easier way to cook!<br />\r\nWith the Crock-Pot 8-Quart Oval Manual Slow Cooker, you can carry out your full day&#39;s activities and still enjoy a nutritious, home-cooked meal in the evening. The 8-quart extra-large capacity is perfect for larger families or entertaining! It&#39;s a healthy, cost-efficient, and convenient way to serve tasty, satisfying meals.</p>\r\n\r\n<p>This Crock-Pot Manual Slow Cooker cooks on high or low cook settings and the warm setting can be used to keep your dish at an ideal serving temperature.</p>\r\n\r\n<p>Serves 10+ people<br />\r\nManual control with high/low cook settings and convenient warm setting<br />\r\nDishwasher-safe stoneware and glass lid<br />\r\nCord length: 24&quot;</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nThis Crock-Pot 8-Quart Oval Manual Slow Cooker provides you the flexibility to prepare a meal early, and then have it slow-cook all day. You can carry out your full day&#39;s activities and still enjoy a nutritious, home-cooked meal in the evening. The 8-quart extra-large capacity is also perfect for larger families or entertaining! It&#39;s a healthy, cost-efficient, and convenient way to serve tasty, satisfying meals. This Crock-Pot Manual Slow Cooker cooks on High or Low settings and the Warm setting can be used to keep your dish at an ideal serving temperature.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;9.5 x 15.3 x 15.4 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;15.6 pounds<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Crock-Pot<br />\r\nASIN&nbsp;&nbsp; &nbsp;B0196B3P1E<br />\r\nItem model number&nbsp;&nbsp; &nbsp;SCV800-B</p>', NULL, 'crock-pot-scv800-b-8-quart-oval-manual-slow-cooker-black', '771608186581.jpg', '179.00', 'fixed', NULL, NULL, NULL, 'fixed', '179.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 06:29:52', '2020-12-17 06:29:52'),
(334, 'Elite Gourmet Lid & Ceramic Pot Slow Cooker with Adjustable Temp, Entrees, Sauces, Stews & Dips', 4, 20, NULL, '<p><strong>About this item</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>1.5 Quart removable inner stoneware pot<br />\r\nConvenient LOW / HIGH / KEEP WARM settings<br />\r\nAttractive stainless steel finish and tempered clear glass lid<br />\r\nCool-touch handles and knobs while powered at 120 watts<br />\r\nDishwasher safe glass lid and stoneware pot<br />\r\n1.5 Quart removable inner stoneware pot<br />\r\nConvenient LOW / HIGH / KEEP WARM settings<br />\r\nAttractive stainless steel finish<br />\r\nTempered clear glass lid<br />\r\nCool-touch handles and knobs<br />\r\nDishwasher safe glass lid and stoneware pot<br />\r\n120W</p>\r\n</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nThe Elite Gourmet 1.5 Qt. Mini Slow Cooker is perfect for cooking and serving small one-pot meals and appetizers such as soups, stews, meatballs, dips, and sauces. It&#39;s a great kickoff for a fondue party or where everyone prepares their favorite dip in their 1.5 Qt. Mini Slow Cooker. This versatile small appliance can be a single person&#39;s best companion as well as the all-star at your next Super Bowl party. It features low and high temperature settings, a keep-warm setting allowing you to keep your meal hot and fresh before it&rsquo;s served, and an attractive stainless steel finish. It includes a removable inner stoneware pot that&rsquo;s easy to clean, with a tempered glass lid with metal rim for easy viewing of cooking cycle and cool-touch handles and knob for safe handling.</p>\r\n\r\n<p><br />\r\n<strong>Product information</strong><br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;8.8 x 8.8 x 6 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;4.54 pounds<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Elite Gourmet<br />\r\nASIN&nbsp;&nbsp; &nbsp;B008GS8R3K<br />\r\nDomestic Shipping&nbsp;&nbsp; &nbsp;Item can be shipped within U.S.<br />\r\nInternational Shipping&nbsp;&nbsp; &nbsp;This item can be shipped to select countries outside of the U.S. Learn More<br />\r\nItem model number&nbsp;&nbsp; &nbsp;MST-250XS</p>', NULL, 'elite-gourmet-lid-ceramic-pot-slow-cooker-with-adjustable-temp-entrees-sauces-stews-dips', '551608186737.jpg', '389.00', 'fixed', NULL, NULL, NULL, 'fixed', '389.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 06:32:37', '2020-12-17 06:32:37'),
(335, 'Hamilton Beach Slow Cooker, Extra Large 10 Quart, Stay or Go Portable With Lid Lock, Dishwasher', 4, 20, NULL, '<p><strong>About this item</strong><br />\r\nReduce messy spills with Lid Latch strap<br />\r\nLid Latch strap anchors onto base to reduce messy spills<br />\r\nKeep warm setting maintains the ideal serving temperature<br />\r\nDishwasher safe stoneware &amp; glass lid - removable stoneware can also be used in the refrigerator oven or microwave<br />\r\nPerfect size for 5 lb chicken or 3 lb roast<br />\r\nincluded components: 885234004365</p>\r\n\r\n<p><br />\r\nMore flavor. Less planning and prep.<br />\r\nHamilton Beach 5 Quart Slow Cookers are ideal for minimizing weeknight stress &mdash; delicious meals practically cook themselves, with no stirring required. The 5-quart oval stoneware handles a 3-pound beef roast or a 5-pound chicken. The design ensures wraparound, even heat for beautifully blended flavors and tender meat.</p>\r\n\r\n<p>Looking for portability? Hamilton Beach 5 Quart Slow Cookers include easy-grip handles for convenient carrying, and some models come complete with a Lid Latch strap for easy transport. A variety of delicious, easy-prep recipes are included, and the removable stoneware is dishwasher safe.</p>\r\n\r\n<p><br />\r\n<strong>Product description</strong><br />\r\nSize:5-Quart<br />\r\nHamilton Beach 5 qtr portable slow cooker offers convenience and ease for your next party The oval shape is perfect for a 5lb chicken or 3lb roast. The 5-quart oval stoneware handles a 3-pound beef roast or a 5-pound chicken. The design ensures wraparound, even heat for beautifully blended flavors and tender meat.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nSize:5-Quart<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;10.6 x 15.5 x 8.8 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;9.5 pounds<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Hamilton Beach<br />\r\nASIN&nbsp;&nbsp; &nbsp;B005UN6O66<br />\r\nItem model number&nbsp;&nbsp; &nbsp;33256<br />\r\nBrand&nbsp;&nbsp; &nbsp;Hamilton Beach<br />\r\nColor&nbsp;&nbsp; &nbsp;Black<br />\r\nMaterial&nbsp;&nbsp; &nbsp;Stoneware<br />\r\nItem Dimensions LxWxH&nbsp;&nbsp; &nbsp;10.6 x 15.5 x 8.8 inches<br />\r\nCapacity&nbsp;&nbsp; &nbsp;4.73 Liters<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;9.5 Pounds<br />\r\nShape&nbsp;&nbsp; &nbsp;Oval<br />\r\n&nbsp;</p>', NULL, 'hamilton-beach-slow-cooker-extra-large-10-quart-stay-or-go-portable-with-lid-lock-dishwasher', '271608725659.jpg', '169.00', 'fixed', NULL, NULL, NULL, 'fixed', '169.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 1, NULL, '2020-12-17 06:37:56', '2020-12-23 02:23:37'),
(337, 'Mueller 6 Quart Pressure Cooker 10 in 1, Cook 2 Dishes at Once', 4, 20, NULL, '<p><strong>About this item</strong><br />\r\n10 Appliances In 1 &amp; 15 Preset Smart Programs &ndash; Unlike most other Hot Pots on the market, ours gives you the flexibility to manually input cooking times when required and you also have the pre-programmed smart programs already set for many dishes such as Oatmeal, Broth/Soup, Poultry, Yogurt, Egg, Beans/Chilli, Rice, Pressure Cook (Manual Setting), Meat/Stew, Cake. Slow Cook, Steam, Saute, Canning &amp; Multi-Grain so all of your favorite dishes are as easy as pressing a button<br />\r\nGerman Engineered To Last - Unlike other models our cooker is made with high quality rubber seals, strong reliable heat resistant handles and internal electronics made to stand the test of time.<br />\r\n2 Dishes Simultaneously &amp; Accessories Included - We have included a BONUS Stainless Steel Steamer Basket which allows you to cook 2 dishes at the same time as well as an extra silicone gasket, ladle and measuring cup saving you time and money!<br />\r\nStrongest &amp; Healthiest - Ceramic non-stick interior coating, plastic PTFE and PFOA free for even heat distribution, fully sealed environment seals in the flavors, nutrients and aromas within the food to Healthy, stainless steel (18/10) inner cooking pot made from food grade 304 ss, no chemical coating, 3-ply bottom for even heat distribution, fully sealed environment traps the flavors, nutrients and aromas within the food<br />\r\nNext Generation Electronic Controls - Built with the latest generation technology, microprocessors monitor pressure, temperature, keep time and adjust heating intensity and duration to achieve your desired results every time. UL and ULC certified with 8 safety mechanisms in place to provide you with added assurance, designed to eliminate many common errors.</p>\r\n\r\n<p><br />\r\n<strong>FAST, EASY, AND SAFE!</strong><br />\r\nThis pressure cooker uses cutting-edge technology so you and your family can enjoy the beneﬁts of better, faster and healthier cooking. Your pressure cooker seals in steam to cook hotter and faster while maintaining important nutrients for healthier meals. Cooking fast and with less water saves vital natural resources and energy! It&rsquo;s the easiest pressure cooker to use on the market.</p>\r\n\r\n<p><br />\r\n<strong>STAINLESS STEEL NICKEL FINISH</strong><br />\r\nThis results in the formation of an &ldquo;austenitic&rdquo; structure that gives our inner pot strength, ductility and toughness, even at extremely high temperatures. It also makes the material non-magnetic.</p>\r\n\r\n<p>REPLACES 10 COMMON KITCHEN APPLIANCES<br />\r\nPressure cooker, slow cooker, rice/porridge cooker, yogurt maker, cake maker, egg cooker, saut&eacute;/searing, steamer, warmer, sterilizer</p>\r\n\r\n<p>EASY AND INTUITIVE TO USE WITH NEW SMART CONTROL<br />\r\nDesigned so you can create your culinary masterpiece fast and easy. Cooking will be done automatically by selecting the diﬀerent menu choices on the unit.</p>\r\n\r\n<p>MANUAL SETTINGS BUTTON<br />\r\nUse the Manual Setting Button to adjust the cooking time by yourself. You can set it from 1~99 minutes cooking range.</p>\r\n\r\n<p><strong>DELAY TIMER</strong><br />\r\nIf you wish to Program your pressure cooker to automatically cook prepared food at a later time, you can program the pressure cooker to delay cooking by up to 24-hours.</p>\r\n\r\n<p>COOK TWO DISHES SIMULTANEOUSLY<br />\r\nStainless Steel Basket and Rack are included, allowing you to cook TWO dishes at once, saving you time and money!</p>\r\n\r\n<p>PRESERVES NUTRIENTS &amp; PROMOTES HEALTHY EATING<br />\r\nFully sealed environment traps the original flavors, preserve nutrients and aromas within the food.</p>\r\n\r\n<p>EASY CANNING / PRESERVING FOOD<br />\r\nThis pressure cooker can be used to do basic pressure canning and the water-bath method. Low-Acidic fruits and vegetables and High-Acidic fruits and vegetables are recommended.</p>\r\n\r\n<p><strong>INCLUDED</strong><br />\r\nTempered Glass Lid<br />\r\nMeasuring Cup<br />\r\nSpoon<br />\r\nSteamer Basket<br />\r\nSilicone Gasket</p>\r\n\r\n<p><br />\r\nTASTY RECIPES INCLUDED<br />\r\nYou receive a Cook Book with 30 tasty and healthy recipes with easy-to-follow steps to create wholesome meals in minutes.</p>\r\n\r\n<p>GERMAN ENGINEERED TO LAST<br />\r\nUnlike other models, our cooker is made with high quality rubber seals, strong reliable heat resistant handles and internal electronics made to stand the test of time.</p>\r\n\r\n<p>Mueller USA&rsquo;s Mission<br />\r\nOur mission is to deliver simply superior products with real human support that improve people&#39;s lives and share our success with non-profits we love!</p>\r\n\r\n<p><br />\r\n<strong>Product information</strong><br />\r\nColor:Slate Gray<br />\r\nPackage Dimensions&nbsp;&nbsp; &nbsp;15.5 x 13 x 13 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;15.42 pounds<br />\r\nDepartment&nbsp;&nbsp; &nbsp;MU-ULTPOT<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;Mueller Austria<br />\r\nASIN&nbsp;&nbsp; &nbsp;B07Q5BZFLB<br />\r\nItem model number&nbsp;&nbsp; &nbsp;MU-ULTPOT2</p>', NULL, 'mueller-6-quart-pressure-cooker-10-in-1-cook-2-dishes-at-once', '141608187452.jpg', '345.00', 'fixed', NULL, NULL, NULL, 'fixed', '345.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-17 06:44:22', '2020-12-17 06:44:22'),
(338, 'ELUK OMEN Obelisk Gaming Desktop PC Liquid Cooled Intel Core i9-9900K CPU, NVIDIA RTX 2080 Ti', 1, 12, 13, '<p>It&rsquo;s gaming love at first sight. The OMEN 30L Desktop PC is crafted for the long term &amp; was designed in collaboration with Cooler Master from the ground-up. A hassle-free OMEN RGB liquid cooling system quietly draws heat away from one of Intel&#39;s highest rated unlocked performance processors. Cooler Master&#39;s 750 watt platinum power supply provides maximum efficiency &amp; Kingston HyperX RGB XMP brings the customizable flair with performance.</p>\r\n\r\n<p>Operating System: Windows 10 Professional 64-Bit</p>\r\n\r\n<p>Motherboard: Z490 Chipset</p>\r\n\r\n<p>Processor: Intel Core i9-10900K Deca Core (3.7-5.3GHz TurboBoost, 20MB Cache)</p>\r\n\r\n<p>Cooling: RGB Liquid Cooling Solution</p>\r\n\r\n<p>RAM: 16GB HyperX RGB DDR4 RAM</p>\r\n\r\n<p>Graphics: 11GB GDDR6 NVIDIA GeForce RTX 2080 Ti</p>\r\n\r\n<p>Total Storage: 2,512GB (512GB SSD + 2TB 7200RPM HDD)</p>\r\n\r\n<p>Primary: 512GB Western Digital Black Ultra Performance PCIe NVME SSD</p>\r\n\r\n<p>Secondary: 2TB 7200RPM SATA III Storage Hard Drive</p>\r\n\r\n<p>Optical: N/A</p>\r\n\r\n<p>Wi-Fi: Intel Wi-Fi 6 AX201 (2x2) and Bluetooth 5</p>\r\n\r\n<p>Accessories: HP Wired Keyboard with volume control, Wired Mouse &amp; Eluktronics RGB Mousepad</p>\r\n\r\n<p>Ports: Front I/O: 2 SuperSpeed USB Type-A 5Gbps signaling rate; 1 microphone; 1 headphone/microphone combo Rear I/O: 1 SuperSpeed USB Type-C 10Gbps signaling rate; 2 SuperSpeed USB Type-A 10Gbps signaling rate; 2 SuperSpeed USB Type-A 5Gbps signaling rate; 2 USB 2.0 Type-A; 1 audio-in; 1 audio-out; 1 microphone; 1 RJ-45</p>\r\n\r\n<p>Aesthetics: Shadow black front bezel - Tempered Glass Side Window</p>\r\n\r\n<p>Audio: Audio by Bang &amp; Olufsen</p>\r\n\r\n<p>Power: 750 Watt Cooler Master Platinum Power Supply</p>\r\n\r\n<p>Warranty: One Year Eluktronics Warranty with USA Based Support<br />\r\nEluktronics is an HP Authorized Value Added Reseller. In the event you encounter an issue, Eluktronics should be the first point of contact for resolution.</p>\r\n\r\n<p><br />\r\nGraphics Coprocessor &nbsp;&nbsp; &nbsp;NVIDIA GeForce RTX 2080 Ti<br />\r\nChipset Brand &nbsp;&nbsp; &nbsp;NVIDIA<br />\r\nCard Description &nbsp;&nbsp; &nbsp;Dedicated<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;Eluktronics<br />\r\nItem model number &nbsp;&nbsp; &nbsp;Omen Obelisk<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Windows 10<br />\r\nColor &nbsp;&nbsp; &nbsp;2080 Ti<br />\r\nProcessor Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nProcessor Count &nbsp;&nbsp; &nbsp;10<br />\r\nComputer Memory Type &nbsp;&nbsp; &nbsp;DIMM<br />\r\nHard Drive Interface &nbsp;&nbsp; &nbsp;Solid State</p>', NULL, 'eluk-omen-obelisk-gaming-desktop-pc-liquid-cooled-intel-core-i9-9900k-cpu-nvidia-rtx-2080-ti', '501608188077.jpg', '879.00', 'fixed', NULL, NULL, NULL, 'fixed', '879.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-17 06:56:21', '2020-12-17 06:56:21'),
