(342, 'CHUWI HeroBox Windows 10 Mini PC, Intel Gemini-Lake N4100', 1, 12, 12, '<p>&nbsp;Faster Running Speed &mdash;&mdash; CHUWI Herobox Mini PC equips with 64-bit windows 10 Intel Gemini-Lake N4100 Quad-Core processor.And loaded with 8GB DDR4 RAM, 256GB SSD ROM. Powerful hardware makes it run more smoothly and stable.<br />\r\n✔ Expand Storage by Multi-ways &mdash;&mdash; Support SATA HDD ( up to 2TB ) and TF card ( up to 128GB), Meanwhile, it comes with 2*USB 2.0 ports, 2 *USB 3.0 ports and Type-c. VGA and HD port are also availble, and the HD port port can output 4K, 60FPS video.<br />\r\n✔ Greatly improve transmission frequency &mdash;&mdash; The latest wireless connectivity with Dual-Band 2.4G+5G Wi-Fi, it offers speeds up to 450Mbps on the 2.4GHz band &amp; 1300Mbps on the 5GHz.<br />\r\n✔ Fanless and Silence design &mdash;&mdash; Very Silent with great performance, this mini pc adopts energy efficient components and cooling elements, there is no noisy during operating and the resolution up to 4096*2160@60Hz and plays 4K video smoothly.<br />\r\n✔ Great Home Theater PC &mdash;&mdash; The mini desktop computer comes with 4K ultra high definition streaming capability, giving you a best-in-class television experience with true-to-life picture quality,which can be used as a media center to enjoy TV shows or games.</p>\r\n\r\n<p><br />\r\n<strong>Dual-band wifi supports 2.4G/5G !</strong></p>\r\n\r\n<p>Dual-band wifi supports 2.4G/5G frequency band, operating on the newer LEEE802.11ac standard.</p>\r\n\r\n<p>5G delivers ultimate fast internet speed,while 2.4G goes for more stable connection.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2 (1) (2)_1608197050.jpg\" style=\"height:1000px; width:1000px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Smoothly 4K Decoding !</strong></p>\r\n\r\n<p>Intel UHD Graphics 600 Gen9 12EU, comes with 18 execution units clock up to 700MHz, which is twice faster than its previous generation.</p>\r\n\r\n<p>It can comprehensively decode 4K videos and edit pictures with finest quality image.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2 (2) (2)_1608197071.jpg\" style=\"height:1000px; width:1000px\" /></p>\r\n\r\n<p><br />\r\n<strong>Fast Speed! 8GB DDR4 and 256GB SSD !</strong></p>\r\n\r\n<p>We equip HeroBox with 256GB SSD and 2.5 inch HDD can fully cover your storage needs.</p>\r\n\r\n<p>8GB DDR4 memory improves 75% transmission frequency, which enables snappy and seamless switch between different tasks.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/2 (3) (2)_1608197086.jpg\" style=\"height:1000px; width:1000px\" /></p>\r\n\r\n<p><br />\r\nWireless Type &nbsp;&nbsp; &nbsp;5 GHz Radio Frequency, 2.4 GHz Radio Frequency<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;CHUWI<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Linux, Windows 10 Home<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;2.86 pounds<br />\r\nPackage Dimensions &nbsp;&nbsp; &nbsp;9.76 x 9.25 x 2.36 inches<br />\r\nColor &nbsp;&nbsp; &nbsp;Black<br />\r\nProcessor Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nProcessor Count &nbsp;&nbsp; &nbsp;4<br />\r\nComputer Memory Type &nbsp;&nbsp; &nbsp;DDR3 SDRAM<br />\r\nHard Drive Interface &nbsp;&nbsp; &nbsp;Ethernet 100Base-TX</p>', NULL, 'chuwi-herobox-windows-10-mini-pc-intel-gemini-lake-n4100', '411608196946.jpg', '375.00', 'fixed', NULL, NULL, NULL, 'fixed', '375.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 1, 0, 0, NULL, '2020-12-17 09:26:36', '2020-12-17 09:26:36'),
