(345, 'ACAPC Mini PC, 8GB RAM 120GB ROM Mini Computer Intel', 1, 12, 12, '<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (7) (2)_1608198105.jpg\" style=\"height:674px; width:1090px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【Intel Celeron Processor】Mini PC powered by Intel Celeron Apollo Lake J3455(up to 2.3Ghz), Intel HD Graphics and pre-installed Windows 10 Pro, perfect for web browsing, movie watching, and streaming videos. Very fast and no lagging or jumping.<br />\r\n【Storage Expansion】Mini computer removable enclosure on the bottom, support mSATA and 2.5 inch SSD/HDD, expand extra storage up to 1TB, and you can set it as boot drive. Meanwhile, you can also insert micro SD card, or connect external hard drive.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (8) (2)_1608198060.jpg\" style=\"height:337px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (6) (2)_1608198086.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p><br />\r\n【Dual HDMI 4K Display】Two HDMI output ports can support dual-screen display conveniently, which means it will increase work efficiency. 4K HD for visually home entertainment. Package with VESA mount and screws, easily hide the mini PC on the back of monitor or HDTV.<br />\r\n【Meet daily needs】 Designed with 2 x HDMI output port, 2 x USB 2.0 ports, 2 x USB 3.0 ports ,1 x Gigabit Ethernet port,1 x Micro SD Card port slot (for TF cards with up to 128GB),headphone &amp; mic phone port. multiple options with dual-band WiFi (2.4 + 5 Ghz) and Bluetooth 4.2.<br />\r\n【Worry-free Service】ACEPC provide 12-month satisfaction and LIFETIME technical support service, please feel free to contact ACEPC customer service if any issues happened.</p>\r\n\r\n<p><br />\r\nProcessor &nbsp;&nbsp; &nbsp;Intel Core i5-5257U &nbsp;&nbsp; &nbsp;Intel Gemini Lake Celeron J4125 &nbsp;&nbsp; &nbsp;Intel Atom x5-Z8350<br />\r\nStorage expansion &nbsp;&nbsp; &nbsp;2.5-inch SSD &nbsp;&nbsp; &nbsp;NVMe PCIe M.2 2242/ SATA / SSD / Micro SD &nbsp;&nbsp; &nbsp;SSD / Micro SD Card<br />\r\nMemory (RAM) Size &nbsp;&nbsp; &nbsp;8GB &nbsp;&nbsp; &nbsp;8GB &nbsp;&nbsp; &nbsp;8GB<br />\r\nHard Disk Size &nbsp;&nbsp; &nbsp;120GB &nbsp;&nbsp; &nbsp;120GB &nbsp;&nbsp; &nbsp;120GB<br />\r\nMax Turbo Frequency &nbsp;&nbsp; &nbsp;3.1GHz &nbsp;&nbsp; &nbsp;2.7GHz &nbsp;&nbsp; &nbsp;1.92 GHz<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Windows 10 Pro(64-Bit) &nbsp;&nbsp; &nbsp;Windows 10 Pro(64-Bit) &nbsp;&nbsp; &nbsp;Windows 10 Pro(64-Bit)<br />\r\nVideo Interface &nbsp;&nbsp; &nbsp;1X VGA+1X HDMI+1X DP &nbsp;&nbsp; &nbsp;2X HDMI &nbsp;&nbsp; &nbsp;1X VGA+1X HDMI<br />\r\n# of Displays Supported &nbsp;&nbsp; &nbsp;3 &nbsp;&nbsp; &nbsp;2 &nbsp;&nbsp; &nbsp;2<br />\r\nUSB Port &nbsp;&nbsp; &nbsp;4X USB 3.0 &amp; 2X USB 2.0 &nbsp;&nbsp; &nbsp;2X USB 3.0 &amp; 2X USB 2.0 &nbsp;&nbsp; &nbsp;2X USB 3.0 &amp; 2X USB 2.0<br />\r\nWifi,Bluetooth,LAN &nbsp;&nbsp; &nbsp;2.4G/5G, BT4.2, 10/100M/1000M</p>\r\n\r\n<p>&nbsp;</p>', NULL, 'acapc-mini-pc-8gb-ram-120gb-rom-mini-computer-intel', '631608197873.jpg', '279.00', 'fixed', NULL, NULL, NULL, 'fixed', '279.00', NULL, NULL, NULL, 1, NULL, 1, 2, 1, 1, 0, 0, 0, NULL, '2020-12-17 09:42:33', '2020-12-20 01:08:57'),
(346, 'Apple iMac Pro (27-inch, 3.0GHz 10-core Intel Xeon W Processor, 32GB RAM, 1TB SSD Storage)', 1, 12, 11, '<p><br />\r\n<img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (6) (2)_1608198342.jpg\" style=\"height:2243px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (7) (2)_1608198359.jpg\" style=\"height:2242px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (8) (2)_1608198375.jpg\" style=\"height:2243px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (9) (2)_1608198390.jpg\" style=\"height:2242px; width:1090px\" /></p>\r\n\r\n<p><strong>&nbsp;About this item</strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; 27-inch (diagonal) Retina 5K display<br />\r\n&nbsp;&nbsp;&nbsp; 5120‑by‑2880 resolution with support for one billion colors<br />\r\n&nbsp;&nbsp;&nbsp; Stunning 5-mm-thin design<br />\r\n&nbsp;&nbsp;&nbsp; 10-core Xeon W processor<br />\r\n&nbsp;&nbsp;&nbsp; AMD Radeon Pro Vega 56 graphics with 8GB of HBM2 memory<br />\r\n&nbsp;&nbsp;&nbsp; 32GB of memory<br />\r\n&nbsp;&nbsp;&nbsp; 1TB of SSD storage</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Four Thunderbolt 3 (USB-C) ports, four USB-A ports, SDXC card slot, 10Gb Ethernet, 3.5 mm headphone jack, stereo speakers, and four mics<br />\r\n&nbsp;&nbsp;&nbsp; 802.11ac Wi-Fi and Bluetooth 5.0<br />\r\n&nbsp;&nbsp;&nbsp; Magic Mouse 2, Magic Keyboard with Numeric Keypad</p>\r\n\r\n<p>Product Dimensions &nbsp;&nbsp; &nbsp;30.12 x 24.21 x 9.84 inches; 41.3 Pounds<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;41.2 pounds<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Apple Computer<br />\r\nASIN &nbsp;&nbsp; &nbsp;B08F8HKQ4B<br />\r\nItem model number &nbsp;&nbsp; &nbsp;MHLV3LL/A<br />\r\nBatteries &nbsp;&nbsp; &nbsp;2 Lithium ion batteries required. (included)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 4, 'apple-imac-pro-27-inch-30ghz-10-core-intel-xeon-w-processor-32gb-ram-1tb-ssd-storage', '831608198228.jpg', '2599.00', 'discount', '2399.00', '2020-12-10', NU