(347, 'New Apple iMac with Retina 5K Display (27-inch, 8GB RAM, 256GB SSD Storage)', 1, 12, 11, '<p>27&quot; iMac with Retina 5K Display - Magic Keyboard - Magic Mouse 2 (Silver) - Lightning to USB Type-A Cable (3.3&#39;) - Power Cord - Polishing Cloth - Apple 1 Year Limited Warranty<br />\r\nStandard glass<br />\r\n3.3GHz 6-core 10th-generation Intel Core i5 processor, Turbo Boost up to 4.8GHz<br />\r\n16GB 2666MHz DDR4 memory</p>\r\n\r\n<p><br />\r\nRadeon Pro 5300 with 4GB of GDDR6 memory</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (6) (2)_1608199329.jpg\" style=\"height:1362px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (7) (2)_1608199348.jpg\" style=\"height:1362px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (8) (2)_1608199367.jpg\" style=\"height:1362px; width:1090px\" /></p>\r\n\r\n<p>The All-In-One For All - iMac 27&quot;If you can dream it, you can do it on iMac. It&#39;s beautifully designed, incredibly intuitive, and packed with powerful tools that let you take any idea to the next level. And the new 27-inch model elevates the experience in every way, with faster processors and graphics, expanded memory and storage, enhanced audio and video capabilities, and an even more stunning Retina 5K display. It&#39;s the desktop that does it all - better and faster than ever.Retina DisplayDraws you in. Blows you away. Everything looks better on a Retina display, with its one billion colors and 500 nits of brightness. Photos and graphics leap off the screen. Text is supersharp. And for the first time, the 27-inch iMac features True Tone technology for a more natural viewing experience. 5K Retina display True Tone technology for a more natural viewing experienceProcessor and MemoryFrom fast to fasten your seatbelt. iMac and powerful processors go hand in hand. The 27-inch model offers a 6-core Intel Core i5 processor to sail through heavy tasks like layering dozens of audio tracks or compiling and testing code.GraphicsNext-level. At any level. The graphics on iMac make everything a sight to behold. The 27-inch model brings AMD Radeon Pro 5300 graphics with 4GB of GDDR6 memory for graphics-intensive workflows like editing UHD video or developing lifelike game environments.StorageLess Than</p>\r\n\r\n<p>&nbsp;</p>', 4, 'new-apple-imac-with-retina-5k-display-27-inch-8gb-ram-256gb-ssd-storage', '501608199479.jpg', '2569.00', 'fixed', NULL, NULL, NULL, 'fixed', '2569.00', NULL, NULL, NULL, 1, NULL, 1, 1, 1, 0, 1, 0, 0, NULL, '2020-12-17 10:04:52', '2020-12-17 12:06:58'),
