(357, 'BLUblox Tortoise Shell Summer 100% Blue Light Blocking Glasses', 15, NULL, NULL, '<p>SUMMERGLO - Our Mood Booster glasses combine color therapy and blue blocking technology to bring you our SummerGlo lens. The warm yellow lens depicts a sunny summer&rsquo;s day offering uplifting benefits whilst the blue light blocking technology blocks 100% of artificial blue light from 400nm &ndash; 450nm.<br />\r\nTHE LOOK &ndash; Strong fashion statement and vintage inspired design<br />\r\nQUALITY - Lightweight handcrafted frames made from custom acetate with premium spring hinges for the ultimate comfort experience<br />\r\nFRAME FIT - Medium/Large; Measurements - lens &ndash; 53mm / bridge &ndash; 17mm / arms &ndash; 140mm<br />\r\nProudly designed and manufactured in Australia.&nbsp;</p>\r\n\r\n<p><br />\r\nPackage Dimensions &nbsp;&nbsp; &nbsp;6.2 x 2.8 x 2.1 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;4.8 ounces<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;BLUblox<br />\r\nASIN &nbsp;&nbsp; &nbsp;B07RX32VVR</p>', NULL, 'blublox-tortoise-shell-summer-100-blue-light-blocking-glasses', '151608454784.jpg', '89.00', 'fixed', NULL, NULL, NULL, 'fixed', '89.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-19 22:59:50', '2020-12-19 22:59:50'),
(358, 'Bose Frames Tenor - Rectangular Polarized, Bluetooth Audio Sunglasses – Black', 15, NULL, NULL, '<p>Redesigned for luxury &mdash; Thoughtfully refined and strikingly elegant, the latest Bose sunglasses blend enhanced features and designs for an elevated way to listen<br />\r\nRectangular Bluetooth sunglasses &mdash; Finished in High-Gloss Black, Bose Frames Tenor style flaunts a refined square frame, a distinctive keyhole bridge, and ultramodern materials. Lens Width: 55 mm | Bridge Width: 18 mm | Temple Length: 155 mm | Temple Width: 143 mm<br />\r\nBose Open Ear audio sunglasses &mdash; Hear lifelike audio while others hear practically nothing. It&rsquo;s an experience that leaves you free to engage with the world, all while discreetly listening to music.<br />\r\nPolarized lenses &mdash; These music sunglasses include shatter- and scratch-resistant polarized lenses to reduce glare, enhance visibility, and block 99% UVA/B rays. And you can add your prescription (Rx) to your Bose sunglasses anytime.<br />\r\nImproved battery life &mdash; Rechargeable music sunglasses with up to 5.5 hours of continuous listening per charge. Bose sunglasses fully charge in 1 hour.<br />\r\nBluetooth sunglasses &mdash; Pair your audio sunglasses to your device to listen to your favorites and take crystal-clear calls. Reliable Bluetooth range up to 30 ft.<br />\r\nAdvanced mic system &mdash; Designed to focus on your voice and reduce the sound of wind and noise around you, take crystal-clear calls on your Bose sunglasses</p>\r\n\r\n<p><strong>&nbsp;Product description</strong><br />\r\nStyle:Glasses &nbsp;| &nbsp;Color:Black</p>\r\n\r\n<p>Without sound, they&rsquo;re just sunglasses. Thoughtfully refined and strikingly elegant, the latest Bose sunglasses are here. Bose Frames Tenor are made for the modern icon, featuring polarized lenses and premium craftsmanship, while miniaturized Bose speakers hidden in the temples produce sound you&rsquo;d never expect from sunglasses. It&rsquo;s a jaw-dropping audio-sunglasses experience that leaves you free to engage with the world around you, all while discreetly listening to music. Crafted from ultra-modern materials, like smooth-as-silk nylon frames and a High-Gloss Black finish, these rectangular Bluetooth sunglasses feature a more comfortable fit, perfect for a wide range of face shapes. The included polarized lenses block up to 99% of UVA/B rays and are shatter and scratch resistant. And there are intuitive touch controls. Swipe the right temple to adjust the volume, double tap to access Siri or Google Assistant, or simply place your music sunglasses upside down to turn them off. These luxurious Bluetooth sunglasses play for up to 5.5 hours at a time and fully charge in one hour. An advanced mic system focuses on your voice while reducing the sound of wind and other noise around you for crystal-clear calls. And they&rsquo;re prescription (Rx) ready. Accessory Mirrored Silver or Mirrored Blue Bose Lenses are available and easily interchanged for a look that&rsquo;s all your own. The dimensions for Bose Frames Tenor style are: Lens Width: 55 mm | Bridge Width: 18 mm | Temple Length: 155 mm | Temple Width: 143 mm<br />\r\nProduct information<br />\r\nStyle:Glasses &nbsp;| &nbsp;Color:Black<br />\r\nPackage Dimensions &nbsp;&nbsp; &nbsp;7.2 x 3 x 2.9 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;12.6 ounces<br />\r\nASIN &nbsp;&nbsp; &nbsp;B08CYY2S3V<br />\r\nItem model number &nbsp;&nbsp; &nbsp;851338-0110<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)</p>', NULL, 'bose-frames-tenor-rectangular-polarized-bluetooth-audio-sunglasses-black', '511608457642.jpg', '65.00', 'fixed', NULL, NULL, NULL, 'fixed', '65.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-19 23:03:50', '2020-12-19 23:47:35'),
