(362, 'Canmixs Wireless Earbuds Bluetooth Headphones with Microphone Earhooks Sport Headset Touch Control T', 1, 11, 26, '<p><strong>&nbsp;About this item</strong></p>\r\n\r\n<p>Super Strong Bluetooth 5.0 Connection &amp; Easy To Pair&nbsp;Sports wireless earphones tws are specially made for running workout fitness. Bluetooth 5.0 wireless Earbuds headsets get 2x faster transmission speed + more stable connectivity with no signal loss or music dropouts.Never worry about any cut off during listening and controlling. Pick up 2 headsets from charging box, they will connect each other automatically, only one step easily set phone Bluetooth to pair earbuds wireless headphones.</p>\r\n\r\n<p><br />\r\nWireless Earbuds Sport Fit Design &amp; Touch Control With ergonomic and earhook sport design, bluetooth earbuds sport headphones can fit and stay secured in ear canal even with intense movement.With smart touch sensors, you can get ultimate control without using phone and largely prevent the discomfort like physical button, could control volume, go back or forward song and accept or reject calls.Bluetooth headphones with microphone makes an ideal companion while running, sports, gym, cycling.</p>\r\n\r\n<p><br />\r\nSuperior HD Stereo Headphones With Microphone Bluetooth headphones for running offers a truly authentic sound and powerful bass performance with 8mm large size speaker driver - the drive area is 1.77 times than the normal drive area. The unique stereo sound quality and design gives you perfect sound, you can feel the more realistic music.Crystal clarity and Deep, resonant bass with delicately tuned sound signature deliver immersive sound and put you on the stage center.</p>\r\n\r\n<p><br />\r\nWireless Earbuds With Charging Case &amp; 35hrs Playback With highly effective wireless charging case equipped,wireless earphones simplify all charging process.LED display on the charging case can help check the power of earbud and charging case at any time. Portable charging case can recharge earbuds when on-the-go.Earpiece has 5 hours of playtime + extra 30 hours playtime with the charging box and 120 hours for stand-by.Charging case supports earphones bluetooth wireless up to 5 full charges.</p>\r\n\r\n<p><br />\r\nWireless Ear Buds for Android Cell Phones and ios Phones The earbuds with microphone for iphone and android are compatible with almost all Bluetooth-enabled devices on the market. (24 months hassle-free warranty, please feel free to contact us ).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (2)_1608461770.jpg\" style=\"height:674px; width:1090px\" /><img alt=\"\" src=\"http://192.168.0.102/sell/images/3 (1) (2)_1608461722.jpg\" style=\"height:1090px; width:1090px\" /></p>\r\n\r\n<p><br />\r\n<strong>Product information</strong><br />\r\nPackage Dimensions &nbsp;&nbsp; &nbsp;4.2 x 3.4 x 1.9 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;6.4 ounces<br />\r\nDepartment &nbsp;&nbsp; &nbsp;Women mens boys girls kids<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;T30<br />\r\nASIN &nbsp;&nbsp; &nbsp;B08DFXYDYP<br />\r\nItem model number &nbsp;&nbsp; &nbsp;T30 wireless earbuds bluetooth<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)</p>', NULL, 'canmixs-wireless-earbuds-bluetooth-headphones-with-microphone-earhooks-sport-headset-touch-control-tws-stereo-earphones', '101608459646.jpg', '229.00', 'fixed', NULL, NULL, NULL, 'fixed', '229.00', NULL, NULL, NULL, 1, NULL, 1, 6, 1, 0, 1, 0, 0, NULL, '2020-12-20 00:57:09', '2020-12-21 02:02:18'),
(363, 'HUAWEI FreeBuds 3 - Wireless Bluetooth Earphone with Intelligent Noise Cancellation', 1, 11, 26, '<p>Brand&nbsp;&nbsp; &nbsp;HUAWEI<br />\r\nConnectivity Technology&nbsp;&nbsp; &nbsp;Bluetooth<br />\r\nColor&nbsp;&nbsp; &nbsp;Black<br />\r\nHeadphones Form Factor&nbsp;&nbsp; &nbsp;In Ear<br />\r\nNoise Control&nbsp;&nbsp; &nbsp;Active Noise Cancellation</p>\r\n\r\n<p><br />\r\n<strong>About this item</strong><br />\r\nA TRUE WIRELESS STEREO EARPHONE - When paired with a phone over Bluetooth, free buds 3 provides users with a true stereo experience when making calls or listening to music. The two earbuds also undergo smart switching depending on the usage scenario and battery level to provide users with an optimum listening experience.<br />\r\nLOW POWER COMSUMPTION, LONG BATTERY LIFE &ndash; free buds 3 uses a low-power Bluetooth chip for reduced power consumption and long battery life. A single charge gives users about 2.5 hours of voice calls or about 4 hours of continuous music playback. Used in conjunction with the charging case, This extends to more than 12 hours of calls and 20 hours of music playback.<br />\r\nNOISE REDUCTION - each earbud has two MEMS silicon microphones featuring call noise reduction technology, which effectively cancels out background noise.<br />\r\nWIND NOISE REDUCTION - Supports wind noise reduction at a maximum wind speed of 20km/h to ensure the effect of the call.<br />\r\nWIRELESS CHARGING (CHARGING CASE) - The earbuds are automatically charged when stored in the charging case. The included charging case supports both wired and wireless charging. When the earbuds are inserted in the charging case, The earbuds will be charged first.</p>\r\n\r\n<p><strong>Product description</strong><br />\r\nColor:Black<br />\r\nHUAWEI FREE BUDS 3 are wireless stereo earphones consisting of left and right earbuds and a charging case, and feature a half-in-ear design for increased wearing comfort.<br />\r\nHUAWEI FREE BUDS 3 can connect to other Bluetooth devices (such as phones and computers) and can be used to make calls and listen to music.<br />\r\nHUAWEI FREE BUDS 3 adopt a 13 mm-diameter dynamic driver acoustic design and dual-microphone noise reduction to ensure high audio quality during calls.<br />\r\nHUAWEI FREE BUDS 3 also features a low power consumption design and when used with the included charging case, provides users with a long battery life.</p>\r\n\r\n<p>The HUAWEI FreeBuds 3 supports the Bluetooth 5.1 protocol and it is backward compatible. In addition, it can complete basic Bluetooth pairing connection with all mobile phones that support Bluetooth protocol (Android / iOS), tablet, PC (notebook), smart screen and other Bluetooth devices.</p>\r\n\r\n<p>After pairing, you can implement the following functions:<br />\r\n- Double-click to operate music playback or answer the phone call.<br />\r\n- ANC active noise cancellation (the best noise reduction gear can be adjusted through HUAWEI AI App).<br />\r\n- Voice assistant (functions such as voice assistant can be started by double-clicking the left or right ear through HUAWEI AI App settings, depending on whether the device supports or opens the voice assistant).</p>\r\n\r\n<p>HUAWEI AI App does not support IOS system: If you&#39;re a iPhone user, double-tap the upper part of the left earbud handle to enable or disable ANC mode. But can not adjust the ANC degree.</p>\r\n\r\n<p><strong>Product information</strong><br />\r\nColor:Black<br />\r\nProduct Dimensions&nbsp;&nbsp; &nbsp;1.63 x 0.8 x 0.7 inches<br />\r\nItem Weight&nbsp;&nbsp; &nbsp;0.317 ounces<br />\r\nASIN&nbsp;&nbsp; &nbsp;B07YXZJP1P<br />\r\nItem model number&nbsp;&nbsp; &nbsp;55031991<br />\r\nBatteries&nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)<br />\r\nWireless communication technologies&nbsp;&nbsp; &nbsp;Bluetooth<br />\r\nConnectivity technologies&nbsp;&nbsp; &nbsp;Bluetooth<br />\r\nAdditional Features&nbsp;&nbsp; &nbsp;Wireless, Microphone, Noise-Canceling, IOS, Android<br />\r\nOther display features&nbsp;&nbsp; &nbsp;Wireless<br />\r\nColour&nbsp;&nbsp; &nbsp;Black<br />\r\nManufacturer&nbsp;&nbsp; &nbsp;HUAWEI<br />\r\n&nbsp;</p>', 10, 'huawei-freebuds-3-wireless-bluetooth-earphone-with-intelligent-noise-cancellation', '861608462067.jpg', '325.00', 'fixed', NULL, NULL, NULL, 'fixed', '325.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 1, 0, 0, 0, NULL, '2020-12-20 01:02:12', '2020-12-20 01:02:12'),
