(372, 'Wireless Earbuds, VANKYO X400 4-Mic Noise Cancelling CVC 8.0 Bluetooth Earbuds, 30H Playtime', 1, 11, 26, '<p><strong>&nbsp;About this item</strong></p>\r\n\r\n<p>&nbsp; &nbsp; Wireless Charging &amp; Type-C Quick Charge: Reversible Type-C allows you to charge quickly and easily, and the charging case also supports wireless charging, offers different charging type for you. So you can get 5 hours of playtime (at 80% volume). Charging case provides an extra 30 hours of battery life.<br />\r\n&nbsp; &nbsp; Superior Sound Quality: Wireless earbuds adopts excellent AAC/SBC audio codec, provides a breathtaking sound quality. Unique Hi-Fi Stereo and deep bass immerse you in the world of realistic music. In-ear design isolates external ambient sounds, making the sound clearer.<br />\r\n&nbsp; &nbsp; Convenient Touch Control: Upgraded touch control, Vankyo X400 wireless earbuds are equipped with a sensitive enough high-sensitivity touch sensor that can detect every touch, you only need to move your fingertips to complete a series of operations such as play/pause music, receive/end calls.<br />\r\n&nbsp; &nbsp; Bluetooth 5.0 &amp; Mono Mode: The most advanced Bluetooth 5.0 technology (connection distance up to 45ft) provides a more stable connection, not easy to lose signals or music. During commuting, walking on crowded roads, or driving, you can wear a single earbud (left or right earbud) independently.<br />\r\n&nbsp; &nbsp; One-Step Paring: Once you open the charging box, you can seamlessly pair this device to your Bluetooth devices automatically without any problem. Perfect for your Apple, Android, iPhone, Samsung, Windows, tablets, laptops, etc.</p>\r\n\r\n<p><br />\r\nPackage Dimensions &nbsp;&nbsp; &nbsp;5.43 x 4.09 x 1.73 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;7 ounces<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;vankyo<br />\r\nASIN &nbsp;&nbsp; &nbsp;B08FLGHKHB<br />\r\nBatteries &nbsp;&nbsp; &nbsp;3 Lithium Polymer batteries required. (included)<br />\r\n&nbsp;</p>', NULL, 'wireless-earbuds-vankyo-x400-4-mic-noise-cancelling-cvc-80-bluetooth-earbuds-30h-playtime', '281608467919.jpg', '235.00', 'fixed', NULL, NULL, NULL, 'fixed', '235.00', NULL, NULL, NULL, 1, NULL, 1, 1, 1, 0, 0, 0, 0, NULL, '2020-12-20 02:39:03', '2020-12-20 02:41:11'),
(373, 'Losei Bluetooth 5.0 Sports True Wireless Earbuds Touch Control Earphones Bass Stereo Sound TWS Earho', 1, 11, 26, '<p><img alt=\"\" src=\"http://192.168.0.102/sell/images/1 (1)_1608468395.jpg\" style=\"height:337px; width:1090px\" /></p>\r\n\r\n<p><br />\r\nV5.0 True Wireless Sports Headphones Unlike traditional gym ear buds, Losei X12 Wireless Earbuds adopt advanced Bluetooth 5.0 Chip and Technology that achieved completely zero wire connection between the two Earphones. Get rid of the cable hung around neck when running/hiking/jogging, you&#39;ll always motivate yourself. Especially built for sports.<br />\r\nSuper Comfortable &amp; Secure Fit Made of skin-friendly rubber material, plus ergonomic design, the flexible ear hooks not only ensure secure fit, no falling, but also remain super comfy, you will not feel tired and painful when wearing it for a long time. 2 sized soft silicone tips for option, vents in the tips keep pressure equalized on both sides of the ear buds.<br />\r\nUp to 30 hours of Use Built-in a large capacity Li-on battery of 1050mAh, the charging case can hold 3-4 times full recharge for the twins earphones. Per fully charge last 4-5 hours, you will get up to 30 hours of use with charging box, all-day power, never worry about battery shortage.<br />\r\nHi-fi Stereo Sound Quality Utilizing unique customized built-in speaker &amp; mic, and CVC 8.0 noise canceling technology, Losei X12 emit Hi-fi stereo sound with deep bass. Boost music enjoyment from more stable signal and lower power consumption.<br />\r\nOne Button/Touch Control Smart touch control let you play/pause/change song easily; separate power button also works excellent for volume adjust, say bye-bye to the confusion of complicated repeatedly click. 12 month replacement warranty and 30 days money back without reason, any problem, please contact for help.</p>\r\n\r\n<p><br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;1.85 x 1.18 x 1.54 inches<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;0.635 ounces<br />\r\nManufacturer &nbsp;&nbsp; &nbsp;Losei<br />\r\nASIN &nbsp;&nbsp; &nbsp;B088NQ4DX1<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)<br />\r\n&nbsp;</p>', NULL, 'losei-bluetooth-50-sports-true-wireless-earbuds-touch-control-earphones-bass-stereo-sound-tws-earhooks-headset-with-charging-case', '121608468341.jpg', '189.00', 'fixed', NULL, NULL, NULL, 'fixed', '189.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 1, 0, 0, 0, NULL, '2020-12-20 02:53:56', '2020-12-20 02:53:56');
