(374, 'ALLDOCUBE KBook Lite 2-in-1 Laptop, 13.5 inch HD(3000×2000) IPS Display, Intel Apollo Lake N3350 Pro', 1, 10, 8, '<p><strong>ALLDOCUBE KBook Lite 2-in-1 Laptop</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><img alt=\"\" src=\"http://192.168.0.102/sell/images/KBook Ad (2)_1608469983.jpg\" style=\"height:674px; width:1090px\" /></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>High Performance Laptop Equipped with Intel Apollo Lake N3350 processor (up to 2.4GHz), 4GB RAM and the Intel HD Graphics 500, the light laptop makes multitasking more efficient and image processing more faster.<br />\r\nMinimum Bezel with Maximum View Features 13.5 inch HD(3000&times;2000) IPS display, slims to 0.84inch, the Alldocube laptop could present bright and natural colors for a more realistic viewing experience in a super slim bezel.<br />\r\n128GB ROM with 128GB Expandable Come with 128GB SSD storage and support up to 128GB TF card, the big storage will meet your daily requirements for working and entertainment, such as keep important files, videos, photos, songs, games.etc.<br />\r\nLong Lasting Battery Life With ultra-low power consumption CPU, the 7.6V/5000mAh 38Wh Li-ion Battery enable the 2-in-1 Laptop last over 10 hours. Perfect laptop for school and work.<br />\r\nExtensive Connectivity 2.4/5GHz WIFI, Bluetooth 4.0, 2MP front camera,dual speaker. 2 &times; USB 3.0 Type-A port, 1 &times; USB 3.0 Type-C port, 1 HDMI port,1 x headphone/microphone jack.&nbsp;</p>\r\n\r\n<p><strong>Solid Performance Notebook</strong></p>\r\n\r\n<p>Windows 10 system, Intel dual-core processor up to 2.4GHz could offer you super-fast and snappy performance. Perfect combination the energy saving processor with large capacity 5000mAh battery that can support up to 7 hours video enjoyment.</p>\r\n\r\n<p><br />\r\n<strong>3K Horizon Immersive Experience</strong></p>\r\n\r\n<p>The 13.5inch laptop adopts 3000*2000 HD IPS display, 180&deg;rotation, which could render the images very sharply from different angles, without any lag or distortion, present a vivid and true to life viewing experience while you are using the laptop for working, learning, entertaining, etc.</p>\r\n\r\n<p><br />\r\n<strong>Keyboard &amp; Touch Pad</strong></p>\r\n\r\n<p>Features 17mm key cap and 3mm key pitch, the Ergonomic full size keyboard helps your typing more enjoyable and comfortable, and easy to interact with you laptop by using multiple touch gestures with this large touch pad in the same time.</p>\r\n\r\n<p><br />\r\nStanding screen display size &nbsp;&nbsp; &nbsp;13.5 Inches<br />\r\nMax Screen Resolution &nbsp;&nbsp; &nbsp;3000&times;2000 Pixels<br />\r\nGraphics Coprocessor &nbsp;&nbsp; &nbsp;Intel HD Graphics 500<br />\r\nChipset Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nCard Description &nbsp;&nbsp; &nbsp;Integrated<br />\r\nGraphics Card Ram Size &nbsp;&nbsp; &nbsp;4<br />\r\nWireless Type &nbsp;&nbsp; &nbsp;802.11abg<br />\r\nAverage Battery Life (in hours) &nbsp;&nbsp; &nbsp;10<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;ALLDOCUBE<br />\r\nSeries &nbsp;&nbsp; &nbsp;KBook Lite<br />\r\nItem model number &nbsp;&nbsp; &nbsp;i35AS<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Windows 10<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;3.08 pounds<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;12.3 x 9.4 x 0.6 inches<br />\r\nItem Dimensions LxWxH &nbsp;&nbsp; &nbsp;12.3 x 9.4 x 0.6 inches<br />\r\nColor &nbsp;&nbsp; &nbsp;Silver<br />\r\nRear Webcam Resolution &nbsp;&nbsp; &nbsp;2 MP<br />\r\nProcessor Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nProcessor Count &nbsp;&nbsp; &nbsp;2<br />\r\nComputer Memory Type &nbsp;&nbsp; &nbsp;DDR3 SDRAM<br />\r\nFlash Memory Size &nbsp;&nbsp; &nbsp;128 GB<br />\r\nHard Drive Interface &nbsp;&nbsp; &nbsp;USB 3.0<br />\r\nPower Source &nbsp;&nbsp; &nbsp;Battery Powered<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium ion batteries required. (included)&nbsp;<br />\r\n&nbsp;</p>', NULL,