(375, 'ASUS Chromebook Flip C434 2-In-1 Laptop, 14 Full HD Touchscreen 4-Way NanoEdge', 1, 10, 8, '<p>Plus Chromebooks offer fast performance, smooth video calls and ample storage.<br />\r\nThe 14 inch Full HD Touchscreen NanoEdge display has a durable 360 degree hinge that can be used to flip the touchscreen display to tent, stand, and tablet mode<br />\r\nPowered by the Intel Core m3-8100Y Processor (4M Cache, up to 3.4 GHz) for super-fast and snappy performance. If you use a ton of tabs or run lots of apps, this has the power to get it all done with ease<br />\r\n4GB LPDDR3 RAM; 64GB eMM4GB LPDDR3 RAM; 64GB eMMC storage and 2x USB Type-C (Gen 1) and 1x USB Type-A (Gen 1) ports plus a backlit keyboard (*USB Transfer speed may vary. Learn more at ASUS website)C storage and 2x USB Type-C (Gen 1) and 1x USB Type-A (Gen 1) ports plus a backlit keyboard (*USB Transfer speed may vary. Learn more at ASUS website)<br />\r\nThe lightweight (3 lbs) all-aluminum metal body makes the C434 both durable and beautiful for a timeless look that will never go out of style<br />\r\nChromebook runs on Chrome OS - an operating system by Google that is built for the way we live today. It comes with built-in virus protection, updates automatically*, boots up in seconds and continues to stay fast over time<br />\r\nAll the Google apps you know and love come standard on every Chromebook, which means you can edit, download, and convert Microsoft Office files in Google Docs, Sheets and Slides.</p>\r\n\r\n<p><br />\r\nStanding screen display size &nbsp;&nbsp; &nbsp;14 Inches<br />\r\nMax Screen Resolution &nbsp;&nbsp; &nbsp;1920 x 1080 Pixels<br />\r\nMemory Speed &nbsp;&nbsp; &nbsp;1 GHz<br />\r\nGraphics Coprocessor &nbsp;&nbsp; &nbsp;Intel HD Graphics 615<br />\r\nChipset Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nCard Description &nbsp;&nbsp; &nbsp;Integrated<br />\r\nGraphics Card Ram Size &nbsp;&nbsp; &nbsp;4 GB<br />\r\nWireless Type &nbsp;&nbsp; &nbsp;802.11b/n/ac<br />\r\nNumber of USB 3.0 Ports &nbsp;&nbsp; &nbsp;3<br />\r\nAverage Battery Life (in hours) &nbsp;&nbsp; &nbsp;10 Hours<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;ASUS<br />\r\nSeries &nbsp;&nbsp; &nbsp;ASUS Chromebook Flip C434<br />\r\nItem model number &nbsp;&nbsp; &nbsp;C434TA-DSM4T<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Chrome OS<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;3.3 pounds<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;12.6 x 8 x 0.6 inches<br />\r\nItem Dimensions LxWxH &nbsp;&nbsp; &nbsp;12.6 x 8 x 0.6 inches<br />\r\nColor &nbsp;&nbsp; &nbsp;Silver<br />\r\nProcessor Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nProcessor Count &nbsp;&nbsp; &nbsp;2<br />\r\nComputer Memory Type &nbsp;&nbsp; &nbsp;DDR3 SDRAM<br />\r\nFlash Memory Size &nbsp;&nbsp; &nbsp;64<br />\r\nHard Drive Interface &nbsp;&nbsp; &nbsp;Solid State<br />\r\nHard Drive Rotational Speed &nbsp;&nbsp; &nbsp;10000 RPM<br />\r\nOptical Drive Type &nbsp;&nbsp; &nbsp;No Optical Drive</p>', 12, 'asus-chromebook-flip-c434-2-in-1-laptop-14-full-hd-touchscreen-4-way-nanoedge', '231608529942.jpg', '789.00', 'fixed', NULL, NULL, NULL, 'fixed', '789.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-20 19:52:32', '2020-12-20 19:52:32'),
