(378, 'ASUS UX333FA-AB77 ZenBook 13 Ultra Slim Laptop, 13.3” FHD WideView, 8th-Gen Intel Core i7-8565U CPU,', 1, 10, 9, '<p>Powerful &amp; fast for effortless on-the-go computing: 8th generation Intel Core i7-8565U processor, 512GB PCIe NVMe SSD &amp; 16GB RAM<br />\r\nDurable &amp; reliable: meets the ultra-demanding MIL-STD-810G military standard for reliability and durability, undergoing a punishing testing regime<br />\r\nLong battery life: powered by a high-capacity battery that won&rsquo;t let you down<br />\r\nExclusive ErgoLift design: an engineering masterpiece designed to automatically tilt the keyboard to the most comfortable typing position, plus it improves cooling and audio performance<br />\r\nProfessional Grade: use Windows your way with Windows 10 Professional and hardware TPM security<br />\r\nUltra slim bezels: The 13. 3&rdquo; Full HD NanoEdge display with a 95% screen-to-body ratio is designed to give you the most screen area in the least physical space and makes any visuals more immersive<br />\r\nExclusive ASUS NumberPad: with one tap, your touchpad becomes a numeric keypad for speedy data entry</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Creativity. Style. Innovation. These are the qualities that define the elegant new ZenBook 13. Everything in this take-anywhere masterpiece is designed to give you the freedom to discover your creative power, including its breathtaking frameless NanoEdge display. You&rsquo;ll appreciate not only the tremendous power within, but also the thoughtful attention to detail &mdash; an exclusive ErgoLift hinge and NumberPad touchpad. Designed to give you the most screen area in the least physical space, the new frameless four-sided NanoEdge design of ZenBook 13 is simply breathtaking: it makes any visuals more immersive, with less distraction for your eyes. The ultraslim bezels are just 2. 8mm thin at the sides, 3. 3mm at the bottom and a mere 5. 9mm at the top to accommodate the camera. And with this ultra-compact display, ZenBook 13 is only about the size of an A4 sheet of paper, weighing in at 2. 6 lbs, making it the perfect business laptop to carry around. With any ZenBook, your comfort is one of our top priorities. ZenBook 13 goes the extra mile with its exclusive ErgoLift hinge, an engineering masterpiece designed to automatically tilt the keyboard to the most comfortable typing position. But that&rsquo;s not all: the carefully calculated tilt improves cooling and audio performance, too. All of these carefully thought out design choices make this the perfect professional laptop and a great PC alternative to a MacBook!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nStanding screen display size &nbsp;&nbsp; &nbsp;13.3 Inches<br />\r\nMax Screen Resolution &nbsp;&nbsp; &nbsp;1920 x 1080 Pixels<br />\r\nGraphics Coprocessor &nbsp;&nbsp; &nbsp;Intel HD Graphics 620<br />\r\nChipset Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nCard Description &nbsp;&nbsp; &nbsp;Integrated<br />\r\nGraphics Card Ram Size &nbsp;&nbsp; &nbsp;16 GB<br />\r\nWireless Type &nbsp;&nbsp; &nbsp;Bluetooth, 802.11b/n/ac<br />\r\nNumber of USB 2.0 Ports &nbsp;&nbsp; &nbsp;1<br />\r\nNumber of USB 3.0 Ports &nbsp;&nbsp; &nbsp;2<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;ASUS<br />\r\nSeries &nbsp;&nbsp; &nbsp;Asus ZenBook 13<br />\r\nItem model number &nbsp;&nbsp; &nbsp;UX333FA-AB77<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Windows 10 Pro<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;2.6 pounds<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;11.9 x 7.4 x 0.7 inches<br />\r\nItem Dimensions LxWxH &nbsp;&nbsp; &nbsp;11.9 x 7.4 x 0.7 inches<br />\r\nProcessor Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nProcessor Count &nbsp;&nbsp; &nbsp;4<br />\r\nComputer Memory Type &nbsp;&nbsp; &nbsp;DDR3 SDRAM<br />\r\nFlash Memory Size &nbsp;&nbsp; &nbsp;512<br />\r\nHard Drive Interface &nbsp;&nbsp; &nbsp;Solid State<br />\r\nHard Drive Rotational Speed &nbsp;&nbsp; &nbsp;10000 RPM<br />\r\nOptical Drive Type &nbsp;&nbsp; &nbsp;No Optical Drive<br />\r\nPower Source &nbsp;&nbsp; &nbsp;Battery Powered<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)</p>', 12, 'asus-ux333fa-ab77-zenbook-13-ultra-slim-laptop-133-fhd-wideview-8th-gen-intel-core-i7-8565u-cpu-16gb-ram', '541608532163.jpg', '769.00', 'fixed', NULL, NULL, NULL, 'fixed', '769.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-20 20:30:13', '2020-12-20 20:30:13'),
(379, 'ASUS UX333FA-AB77 ZenBook 13 Ultra Slim Laptop, 13.3” FHD WideView', 1, 10, 9, '<p>Powerful &amp; fast for effortless on-the-go computing: 8th generation Intel Core i7-8565U processor, 512GB PCIe NVMe SSD &amp; 16GB RAM<br />\r\nDurable &amp; reliable: meets the ultra-demanding MIL-STD-810G military standard for reliability and durability, undergoing a punishing testing regime<br />\r\nLong battery life: powered by a high-capacity battery that won&rsquo;t let you down<br />\r\nExclusive ErgoLift design: an engineering masterpiece designed to automatically tilt the keyboard to the most comfortable typing position, plus it improves cooling and audio performance<br />\r\nProfessional Grade: use Windows your way with Windows 10 Professional and hardware TPM security<br />\r\nUltra slim bezels: The 13. 3&rdquo; Full HD NanoEdge display with a 95% screen-to-body ratio is designed to give you the most screen area in the least physical space and makes any visuals more immersive<br />\r\nExclusive ASUS NumberPad: with one tap, your touchpad becomes a numeric keypad for speedy data entry</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Creativity. Style. Innovation. These are the qualities that define the elegant new ZenBook 13. Everything in this take-anywhere masterpiece is designed to give you the freedom to discover your creative power, including its breathtaking frameless NanoEdge display. You&rsquo;ll appreciate not only the tremendous power within, but also the thoughtful attention to detail &mdash; an exclusive ErgoLift hinge and NumberPad touchpad. Designed to give you the most screen area in the least physical space, the new frameless four-sided NanoEdge design of ZenBook 13 is simply breathtaking: it makes any visuals more immersive, with less distraction for your eyes. The ultraslim bezels are just 2. 8mm thin at the sides, 3. 3mm at the bottom and a mere 5. 9mm at the top to accommodate the camera. And with this ultra-compact display, ZenBook 13 is only about the size of an A4 sheet of paper, weighing in at 2. 6 lbs, making it the perfect business laptop to carry around. With any ZenBook, your comfort is one of our top priorities. ZenBook 13 goes the extra mile with its exclusive ErgoLift hinge, an engineering masterpiece designed to automatically tilt the keyboard to the most comfortable typing position. But that&rsquo;s not all: the carefully calculated tilt improves cooling and audio performance, too. All of these carefully thought out design choices make this the perfect professional laptop and a great PC alternative to a MacBook!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nStanding screen display size &nbsp;&nbsp; &nbsp;13.3 Inches<br />\r\nMax Screen Resolution &nbsp;&nbsp; &nbsp;1920 x 1080 Pixels<br />\r\nGraphics Coprocessor &nbsp;&nbsp; &nbsp;Intel HD Graphics 620<br />\r\nChipset Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nCard Description &nbsp;&nbsp; &nbsp;Integrated<br />\r\nGraphics Card Ram Size &nbsp;&nbsp; &nbsp;16 GB<br />\r\nWireless Type &nbsp;&nbsp; &nbsp;Bluetooth, 802.11b/n/ac<br />\r\nNumber of USB 2.0 Ports &nbsp;&nbsp; &nbsp;1<br />\r\nNumber of USB 3.0 Ports &nbsp;&nbsp; &nbsp;2<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;ASUS<br />\r\nSeries &nbsp;&nbsp; &nbsp;Asus ZenBook 13<br />\r\nItem model number &nbsp;&nbsp; &nbsp;UX333FA-AB77<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Windows 10 Pro<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;2.6 pounds<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;11.9 x 7.4 x 0.7 inches<br />\r\nItem Dimensions LxWxH &nbsp;&nbsp; &nbsp;11.9 x 7.4 x 0.7 inches<br />\r\nProcessor Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nProcessor Count &nbsp;&nbsp; &nbsp;4<br />\r\nComputer Memory Type &nbsp;&nbsp; &nbsp;DDR3 SDRAM<br />\r\nFlash Memory Size &nbsp;&nbsp; &nbsp;512<br />\r\nHard Drive Interface &nbsp;&nbsp; &nbsp;Solid State<br />\r\nHard Drive Rotational Speed &nbsp;&nbsp; &nbsp;10000 RPM<br />\r\nOptical Drive Type &nbsp;&nbsp; &nbsp;No Optical Drive<br />\r\nPower Source &nbsp;&nbsp; &nbsp;Battery Powered<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)</p>', 12, 'asus-ux333fa-ab77-zenbook-13-ultra-slim-laptop-133-fhd-wideview', '621608532290.jpg', '995.00', 'fixed', NULL, NULL, NULL, 'fixed', '995.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-20 20:31:41', '2020-12-20 20:31:41'),
(380, 'ASUS VivoBook Flip Thin and Light 2-in-1 Laptop - 11.6 HD Touchscreen, Intel Dual-Core Celeron N3350', 1, 10, 8, '<p>Powerful &amp; efficient Intel Quad-Core Pentium N5000 Processor (Upto 2.7 GHz), 128GB eMMC storage, and 4GB DDR4 RAM<br />\r\n14 inch Glossy screen in a 13 inch frame with Nano Edge HD Wide view technology and a touchscreen display with upto 178&deg; viewing angle optimized for entertainment<br />\r\n13 inches wide, 0.6 inches thin with 0.3 inches bezel for a stunning 73% screen-to-body ratio; aluminum chassis and lightweight at 3.3 pounds<br />\r\nPortable and convertible 2-in-1 laptop with four viewing modes: Tablet, tent, stand, and laptop. Power Adapter - Output 19 V DC, 1.75 A, 33 W. Input - 100 -240 V AC, 50/60 Hz universal. Networking - Wi-Fi Integrated Wi-Fi 5 (802.11 ac). Bluetooth - Bluetooth 4.1<br />\r\nComprehensive connections including, USB 3.1 Type-C (Gen1), Micro HDMI, Micro USB 2.0, SD card reader, Plus headphone out and audio-in Combo jack</p>\r\n\r\n<p><br />\r\nStanding screen display size &nbsp;&nbsp; &nbsp;14 Inches<br />\r\nMax Screen Resolution &nbsp;&nbsp; &nbsp;1366 x 768 Pixels<br />\r\nMemory Speed &nbsp;&nbsp; &nbsp;2.7 GHz<br />\r\nGraphics Coprocessor &nbsp;&nbsp; &nbsp;Intel UHD Graphics 605<br />\r\nChipset Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nCard Description &nbsp;&nbsp; &nbsp;Integrated<br />\r\nGraphics Card Ram Size &nbsp;&nbsp; &nbsp;4 GB<br />\r\nWireless Type &nbsp;&nbsp; &nbsp;Bluetooth, 802.11b/n/ac<br />\r\nNumber of USB 2.0 Ports &nbsp;&nbsp; &nbsp;1<br />\r\nNumber of USB 3.0 Ports &nbsp;&nbsp; &nbsp;1<br />\r\nOther Technical Details<br />\r\nBrand &nbsp;&nbsp; &nbsp;ASUS<br />\r\nSeries &nbsp;&nbsp; &nbsp;Asus VivoBook Flip 14<br />\r\nItem model number &nbsp;&nbsp; &nbsp;TP401MA-AB21T<br />\r\nHardware Platform &nbsp;&nbsp; &nbsp;PC<br />\r\nOperating System &nbsp;&nbsp; &nbsp;Windows 10 S,Windows 10 Home - ASUS recommends Windows 10 Pro<br />\r\nItem Weight &nbsp;&nbsp; &nbsp;3.3 pounds<br />\r\nProduct Dimensions &nbsp;&nbsp; &nbsp;12.9 x 8.9 x 0.6 inches<br />\r\nItem Dimensions LxWxH &nbsp;&nbsp; &nbsp;12.9 x 8.9 x 0.6 inches<br />\r\nProcessor Brand &nbsp;&nbsp; &nbsp;Intel<br />\r\nProcessor Count &nbsp;&nbsp; &nbsp;4<br />\r\nComputer Memory Type &nbsp;&nbsp; &nbsp;DDR3 SDRAM<br />\r\nFlash Memory Size &nbsp;&nbsp; &nbsp;128<br />\r\nHard Drive Interface &nbsp;&nbsp; &nbsp;Solid State<br />\r\nHard Drive Rotational Speed &nbsp;&nbsp; &nbsp;10000 RPM<br />\r\nOptical Drive Type &nbsp;&nbsp; &nbsp;No Optical Drive<br />\r\nPower Source &nbsp;&nbsp; &nbsp;Battery Powered<br />\r\nBatteries &nbsp;&nbsp; &nbsp;1 Lithium Polymer batteries required. (included)</p>\r\n\r\n<p>&nbsp;</p>', 12, 'asus-vivobook-flip-thin-and-light-2-in-1-laptop-116-hd-touchscreen-intel-dual-core-celeron-n3350-processor-4gb-ram-64gb', '851608532467.jpg', '1299.00', 'fixed', NULL, NULL, NULL, 'fixed', '1299.00', NULL, NULL, NULL, 1, NULL, 1, 0, 1, 0, 0, 0, 0, NULL, '2020-12-20 20:35:03', '2020-12-20 20:35:03');
